"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[3356],{1029:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"how-to-build-a-consistent-agentic-ai-workflow-for-team-projects","metadata":{"permalink":"/01010011/blog/how-to-build-a-consistent-agentic-ai-workflow-for-team-projects","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-12-24-how-to-build-a-consistent-agentic-ai-workflow-for-team-projects/how-to-build-a-consistent-agentic-ai-workflow-for-team-projects.mdx","source":"@site/blog/2025-12-24-how-to-build-a-consistent-agentic-ai-workflow-for-team-projects/how-to-build-a-consistent-agentic-ai-workflow-for-team-projects.mdx","title":"\uc77c\uad00\uc131 \uc788\ub294 Agentic AI Workflow\ub97c \ud300 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud558\ub294 \ubc95","description":"alt text","date":"2025-12-24T00:00:00.000Z","tags":[{"inline":true,"label":"agenticai","permalink":"/01010011/blog/tags/agenticai"},{"inline":true,"label":"ai","permalink":"/01010011/blog/tags/ai"},{"inline":true,"label":"claudecode","permalink":"/01010011/blog/tags/claudecode"},{"inline":true,"label":"agentskill","permalink":"/01010011/blog/tags/agentskill"},{"inline":true,"label":"harness","permalink":"/01010011/blog/tags/harness"}],"readingTime":19.21,"hasTruncateMarker":false,"authors":[{"name":"01010011","title":"Sr. Software Engineer, Engineering Manager","url":"https://01010011.blog","page":{"permalink":"/01010011/blog/authors/bahamoth"},"socials":{"x":"https://x.com/010100111010","github":"https://github.com/bahamoth","linkedin":"https://www.linkedin.com/in/byeongsu-kang-38899b86/","blog":"https://01010011.blog"},"imageURL":"https://gravatar.com/avatar/bb2519f8e198b51fdc396e8a9d5f475e?size=256","key":"bahamoth"}],"frontMatter":{"slug":"how-to-build-a-consistent-agentic-ai-workflow-for-team-projects","title":"\uc77c\uad00\uc131 \uc788\ub294 Agentic AI Workflow\ub97c \ud300 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud558\ub294 \ubc95","authors":["bahamoth"],"tags":["agenticai","ai","claudecode","agentskill","harness"]},"unlisted":false,"nextItem":{"title":"Mobile Attribution in the Privacy First Era","permalink":"/01010011/blog/mobile-attribution-in-the-privacy-first-era"}},"content":"import styles from \\"../blog.module.css\\";\\n\\n![alt text](horse.png)\\n\\n# \uc77c\uad00\uc131 \uc788\ub294 Agentic AI Workflow\ub97c \ud300 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud558\ub294 \ubc95\\n\\n## \uac1c\uc694\\n\\n\ucf54\ub529 \uc5d0\uc774\uc804\ud2b8\uac00 \uac1c\ubc1c\uc758 \ud544\uc218 \ub3c4\uad6c\uac00 \ub41c \uc9c0\uae08, AI\ub97c \uc4f0\uc9c0 \uc54a\ub294 \uac1c\ubc1c\uc790\ub97c \ucc3e\uae30\uac00 \uc624\ud788\ub824 \uc5b4\ub835\ub2e4. \uae30\uc5c5\ub4e4\ub3c4 \uc774 \ud750\ub984\uc5d0 \ubc1c\ub9de\ucdb0 OpenAI, Claude, Gemini\ub97c \uc885\ub958\ubcc4\ub85c \uc804\ubd80 \uad6c\ub3c5\ud558\uba70 \uc801\uadf9\uc801\uc778 \uc0ac\uc6a9\uc744 \uc7a5\ub824\ud55c\ub2e4.\\n\\n\ud558\uc9c0\ub9cc \ube44\uc2fc \ube44\uc6a9\uc744 \ub4e4\uc5ec AI\ub97c \uad6c\ub3c5\ud55c\ub2e4\uace0 \ud574\uc11c \uc0dd\uc0b0\uc131\uc774 \uc800\uc808\ub85c \ub192\uc544\uc9c0\uc9c0\ub294 \uc54a\ub294\ub2e4.  \\n[METR \ub9ac\uc11c\uce58](https://metr.org/blog/2025-07-10-early-2025-ai-experienced-os-dev-study/)\uc5d0 \ub530\ub974\uba74 AI \ucf54\ub529 \ub3c4\uad6c\ub97c \uc0ac\uc6a9\ud588\uc744 \ub54c \uac1c\ubc1c \uc644\ub8cc \uc2dc\uac04\uc774 \uc624\ud788\ub824 19% \uc99d\uac00\ud588\ub2e4\ub294 \uacb0\uacfc\ub3c4 \uc788\ub2e4. \uac1c\ubc1c\uc790\ub4e4\uc740 20% \ub2e8\ucd95\uc744 \uae30\ub300\ud588\uc9c0\ub9cc, \uc2e4\uc81c\ub85c\ub294 \uc815\ubc18\ub300\uc600\ub2e4.  \\n\ubc18\uba74, SNS\uc5d0\uc11c \uc790\uc8fc \ud68c\uc790\ub418\ub294 [\ud504\ub85c\uadf8\ub798\ubc0d\uc880\ube44](https://www.inflearn.com/course/350%EA%B0%9C-%EA%B0%9C%EC%9D%B8%EC%95%B1-%EC%9B%94%EA%B8%897%EB%B0%B0-%EC%88%98%EC%9D%B5%EB%8B%AC%EC%84%B1%EB%B0%A9%EB%B2%95)\ub77c\ub294 \uac1c\ubc1c\uc790\ub294 AI\ub97c \ud65c\uc6a9\ud574 350\uac1c\uc758 \uc571\uc744 \uac1c\ubc1c\ud558\uace0 \uc218\uc775\ud654\uc5d0 \uc131\uacf5\ud588\ub2e4\uace0 \ud55c\ub2e4. \uc911\uad6d\uc778 \uac1c\ubc1c\uc790 [EastonDev](https://eastondev.com/blog/en/posts/ai/20251125-ai-refactoring-10000-lines/)\ub294 10,000\ub77c\uc778 \ub808\uac70\uc2dc \ucf54\ub4dc\ub97c 14\uc77c \ub9cc\uc5d0 \ub9ac\ud329\ud1a0\ub9c1\ud558\uba70 \ud14c\uc2a4\ud2b8 \ucee4\ubc84\ub9ac\uc9c0, \ubc84\uadf8, \uc131\ub2a5 \uc9c0\ud45c\uae4c\uc9c0 \uac1c\uc120\ud588\ub2e4.\\n\\n\uac19\uc740 \ub3c4\uad6c\ub97c \uc4f0\uba74\uc11c \uc65c \uc774\ub7f0 \uc0dd\uc0b0\uc131 \ucc28\uc774\uac00 \uc0dd\uae38\uae4c? \uac1c\uc778\uc774 \uac01\uc790 \uc54c\uc544\uc11c AI\ub97c \uc0ac\uc6a9\ud558\ub2e4 \ubcf4\uba74, \ub3c4\uad6c\uc5d0 \ub300\ud55c \uc774\ud574\ub3c4, \ucd95\uc801\ub41c \uacbd\ud5d8, \ud6a8\uacfc\uc801\uc778 \ud65c\uc6a9\ubc95\uc5d0 \ub530\ub77c \uacb0\uacfc\uac00 \ucc9c\ucc28\ub9cc\ubcc4\uc774\uae30 \ub54c\ubb38\uc774\ub2e4. AI \uad6c\ub3c5\uc740 \uac1c\uc778 \ub2a5\ub825\uc758 \uc0c1\ud55c\uc120\uc744 \ub192\uc5ec\uc8fc\uc9c0\ub9cc, \uadf8\uac83\uc774 \uace7 \ud300 \uc804\uccb4\uc758 \uc0dd\uc0b0\uc131 \ud5a5\uc0c1\uc73c\ub85c \uc774\uc5b4\uc9c0\uc9c0\ub294 \uc54a\ub294\ub2e4.\\n\\n\uc774 \uae00\uc5d0\uc11c\ub294 **\uac1c\uc778\uc758 AI \ud65c\uc6a9 \uc5ed\ub7c9\uc744 \ud300 \uc804\uccb4\uc758 \uc5ed\ub7c9\uc73c\ub85c \uc804\ud658\ud558\ub294 \ubc29\ubc95**\uc744 \ub2e4\ub8ec\ub2e4.\\n\\n## LLM\uacfc Harness\uc758 \ud55c\uacc4\\n\\nLLM\uc758 \ud55c\uacc4\ub294 \uc774\ubbf8 \uc798 \uc54c\ub824\uc9c4 \ub0b4\uc6a9\uc774\ubbc0\ub85c \uae4a\uc774 \ub2e4\ub8e8\uc9c0\ub294 \uc54a\uaca0\ub2e4. \ub2e4\ub9cc \ud2b8\ub79c\uc2a4\ud3ec\uba38 \uae30\ubc18 AI\uc5d0\uac8c \uc5c5\ubb34\ub97c \ub9e1\uae38 \ub54c \ubc18\ub4dc\uc2dc \uc778\uc9c0\ud574\uc57c \ud560 \ubcf8\uc9c8\uc801 \ud55c\uacc4\ub97c \uc9da\uace0 \ub118\uc5b4\uac00\ubcf4\uc790.\\n\\n**1. \ucee8\ud14d\uc2a4\ud2b8\ub294 \uc720\ud55c\ud558\ub2e4**\\n\\n\uc544\ubb34\ub9ac \ucee8\ud14d\uc2a4\ud2b8 \uc708\ub3c4\uc6b0\uac00 \ucee4\uc838\ub3c4, \uae34 \ub9e5\ub77d\uc774 \ud544\uc694\ud55c \uc791\uc5c5\uc5d0\ub294 \uc5ec\uc804\ud788 \ud55c\uacc4\uac00 \uc788\ub2e4. \ub300\uaddc\ubaa8 \ucf54\ub4dc\ubca0\uc774\uc2a4 \uc804\uccb4\ub97c \uc774\ud574\ud558\uac70\ub098, \uc218\uc2ed \uac1c \ud30c\uc77c\uc5d0 \uac78\uce5c \ub9ac\ud329\ud1a0\ub9c1\uc744 \ud55c \ubc88\uc5d0 \ucc98\ub9ac\ud558\uae30\ub294 \uc5b4\ub835\ub2e4. \uc774\ub97c \ud574\uacb0\ud558\ub824\uba74 [\ub9e5\ub77d\uc744 \ud6a8\uacfc\uc801\uc73c\ub85c \uc804\ub2ec\ud558\ub294 \ubcc4\ub3c4\uc758 \ubc29\ubc95](https://www.anthropic.com/engineering/effective-harnesses-for-long-running-agents)\uc744 \uace0\uc548\ud574\uc57c \ud55c\ub2e4.\\n\\n**2. \uacb0\uacfc\ubb3c\uc740 \ud655\ub960\uc801\uc774\ub2e4**\\n\\n\uac19\uc740 \ud504\ub86c\ud504\ud2b8\uc5d0\ub3c4 \ub9e4\ubc88 \ub2e4\ub978 \uacb0\uacfc\uac00 \ub098\uc628\ub2e4. \uc774\ub294 LLM\uc758 [\uadfc\ubcf8\uc801\uc778 \uc0dd\uc131 \ubc29\uc2dd](https://huggingface.co/blog/how-to-generate) \ub54c\ubb38\uc774\ub2e4. \ucc3d\uc758\uc801\uc778 \uc791\uc5c5\uc5d0\uc11c\ub294 \uc7a5\uc810\uc774 \ub418\uc9c0\ub9cc, \uc77c\uad00\uc131\uc774 \ud544\uc694\ud55c \uc791\uc5c5\uc5d0\uc11c\ub294 \uce58\uba85\uc801\uc778 \ub2e8\uc810\uc774 \ub41c\ub2e4.\\n\\n**3. \ud658\uac01\uc740 \ud53c\ud560 \uc218 \uc5c6\ub2e4**\\n\\nLLM\uc740 \uc790\uc2e0 \uc788\ub294 \uc5b4\uc870\ub85c \ud2c0\ub9b0 \uc815\ubcf4\ub97c \uc0dd\uc131\ud55c\ub2e4. \ucf54\ub529 \ub9e5\ub77d\uc5d0\uc11c\ub294 \uc874\uc7ac\ud558\uc9c0 \uc54a\ub294 API\ub97c \ud638\ucd9c\ud558\uac70\ub098, deprecated\ub41c \ubb38\ubc95\uc744 \ucd5c\uc2e0\uc778 \uac83\ucc98\ub7fc \uc81c\uc548\ud558\uac70\ub098, \uc544\uc608 \uc5c6\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c import\ud558\ub294 \ucf54\ub4dc\ub97c \ub9cc\ub4e4\uc5b4\ub0b8\ub2e4. \ubb38\uc81c\ub294 \uc774\ub7f0 \ud658\uac01\uc774 \uadf8\ub7f4\ub4ef\ud574 \ubcf4\uc778\ub2e4\ub294 \uac83\uc774\ub2e4. \uac80\uc99d \uc5c6\uc774 AI\uc758 \ucd9c\ub825\uc744 \uadf8\ub300\ub85c \ubbff\uc73c\uba74, \ucef4\ud30c\uc77c \uc5d0\ub7ec\ub294 \uadf8\ub098\ub9c8 \ub2e4\ud589\uc774\uace0 \ub7f0\ud0c0\uc784\uc5d0\uc11c\ub098 \ud655\uc778\ud558\ub294 \ub300\ud615\uc0ac\uace0\ub85c \uc774\uc5b4\uc9c8 \uc218 \uc788\ub2e4.\\n\\n### Harness: \ud604\uc2e4\uc801\uc778 \ud574\uacb0\ucc45\\n\\n\uc774\ub7ec\ud55c \ud55c\uacc4\ub97c \ubcf4\uc644\ud558\ub294 \uc5ec\ub7ec \ubc29\ubc95 \uc911, \ud604\uc7ac \uac00\uc7a5 \uc81c\ud488 \uc218\uc900\uc758 \uc644\uc131\ub3c4\ub97c \ubcf4\uc5ec\uc8fc\ub294 \uac83\uc774 **Harness**(Tool Use \uae30\ubc18\uc758 \uc5d0\uc774\uc804\ud2b8 \uad6c\uc870)\ub2e4. Claude Code, Cursor, Windsurf \uac19\uc740 \ucf54\ub529 \uc5d0\uc774\uc804\ud2b8\ub4e4\uc774 \uc774 \ubc29\uc2dd\uc744 \ucc44\ud0dd\ud558\uace0 \uc788\ub2e4.\\n\\n\ud558\uc9c0\ub9cc Harness\uc5d0\ub294 `**\uc720\ud6a8\uae30\uac04**`\uc774 \uc788\ub2e4.\\n\\n[Bitter Lesson](http://www.incompleteideas.net/IncIdeas/BitterLesson.html)\uc758 \uae68\ub2ec\uc74c, Scaling Law\ub294 \uc5ec\uc804\ud788 \uc720\ud6a8\ud558\ub2e4. \uc5b4\ub290 \ub0a0 \uac11\uc790\uae30 Google\uc774\ub098 OpenAI\uc758 \uc2e0\ubaa8\ub378\uc774 \ub4f1\uc7a5\ud574, \ud300\uc774 \uacf5\ub4e4\uc5ec \uad6c\ucd95\ud55c Harness\ub97c \ubb34\uc6a9\uc9c0\ubb3c\ub85c \ub9cc\ub4e4 \uc218 \uc788\ub2e4. \uc2e4\uc81c\ub85c \uc608\uc804\uc5d0\ub294 PDF\uc5d0\uc11c \ud14d\uc2a4\ud2b8\ub97c \ucd94\ucd9c\ud558\ub824\uba74 \ubcf5\uc7a1\ud55c \ud30c\uc774\ud504\ub77c\uc778\uc774 \ud544\uc694\ud588\uc9c0\ub9cc, \uc774\uc81c\ub294 \uba40\ud2f0\ubaa8\ub2ec \ubaa8\ub378\uc5d0 \uc774\ubbf8\uc9c0\ub85c \ub358\uc9c0\uba74 \ub05d\uc774\ub2e4. \ud300\uc774 \uba87 \uc8fc\uac04 \uad6c\ucd95\ud55c PDF \ud30c\uc2f1 Harness\uac00 \ud558\ub8fb\ubc24 \uc0ac\uc774\uc5d0 \ub808\uac70\uc2dc\uac00 \ub418\uc5b4\ubc84\ub9ac\ub294 \uac83\uc774\ub2e4.\\n\\n### \uadf8\ub7fc\uc5d0\ub3c4 Harness\ub97c \ub9cc\ub4e4\uc5b4\uc57c \ud558\ub294 \uc774\uc720\\n\\n\uc774\ub7f0 \ub9ac\uc2a4\ud06c\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, [\uc9c0\uae08 \ub2f9\uc7a5 Harness\uac00 \uc81c\uacf5\ud558\ub294 \uc0dd\uc0b0\uc131 \ud5a5\uc0c1](https://www.businessinsider.com/ai-coding-agents-adoption-top-tools-2025-8)\uc740 \ubb34\uc2dc\ud560 \uc218 \uc5c6\ub2e4.\\n\\nHarness \uc5c6\uc774 Raw LLM\ub9cc \uc4f0\ub294 \uac83\uacfc, \uc798 \uad6c\uc131\ub41c \uc5d0\uc774\uc804\ud2b8 \ud658\uacbd\uc5d0\uc11c \uc791\uc5c5\ud558\ub294 \uac83\uc758 \uc0dd\uc0b0\uc131 \uaca9\ucc28\ub294 \uc774\ubbf8 \ud06c\uac8c \ubc8c\uc5b4\uc84c\ub2e4. 6\uac1c\uc6d4 \ub4a4 \ubb34\uc6a9\uc9c0\ubb3c\uc774 \ub420 \uc218 \uc788\ub2e4 \ud574\ub3c4, \uadf8 6\uac1c\uc6d4\uac04\uc758 \uc0dd\uc0b0\uc131 \uc774\ub4dd\uc774 \uad6c\ucd95 \ube44\uc6a9\uc744 \uc0c1\ud68c\ud55c\ub2e4\uba74 \ub9cc\ub4e4\uc5b4\uc57c \ud55c\ub2e4.\\n\\n\ubb38\uc81c\ub294 **\uc774 Harness\ub97c \uac1c\uc778\uc774 \uc544\ub2cc \ud300 \uc804\uccb4\uac00 \uc77c\uad00\ub418\uac8c \uc0ac\uc6a9\ud558\ub3c4\ub85d \ub9cc\ub4dc\ub294 \uac83**\uc774\ub2e4.\\n\\n## \uac1c\uc778\uc758 AI \uc5ed\ub7c9 \u2260 \ud300\uc758 AI \uc5ed\ub7c9\\n\\nAI\ub97c \uc798 \uc4f0\ub294 \uac1c\uc778\uc740 \ub9ce\ub2e4. \ud558\uc9c0\ub9cc \uadf8 \uac1c\uc778\uc774 \uc18d\ud55c \ud300\uc774 AI\ub97c \uc798 \uc4f0\ub294\uac00\ub294 \uc804\ud600 \ub2e4\ub978 \ubb38\uc81c\ub2e4.\\n\\n\ud300\uc6d0\ub4e4\uc5d0\uac8c \ube44\uc2fc AI \uad6c\ub3c5\uc744 \uc81c\uacf5\ud55c\ub2e4\uace0 \ud574\uc11c \ud300 \uc0dd\uc0b0\uc131\uc774 \uc800\uc808\ub85c \ub192\uc544\uc9c0\uc9c0 \uc54a\ub294\ub2e4. \uac1c\uc778 \ub2e8\uc704\uc758 AI \ud65c\uc6a9\uc774 \ud300 \ub2e8\uc704\uc758 \uc0dd\uc0b0\uc131\uc73c\ub85c \uc804\ud658\ub418\uc9c0 \ubabb\ud558\ub294 \ub370\ub294 \uad6c\uc870\uc801\uc778 \uc774\uc720\uac00 \uc788\ub2e4.\\n\\n### 1. \uc778\uac04 \uc9c0\ub2a5\uc774 \ubcd1\ubaa9\uc774\ub2e4\\n\\nAI\uc758 \ucf54\ub4dc \uc0dd\uc0b0 \uc18d\ub3c4\ub294 \uc778\uac04\uc758 \ub9ac\ubdf0 \uc18d\ub3c4\ub97c \uc544\ub4dd\ud788 \ub118\uc5b4\uc120\ub2e4. [ITWorld\uc758 \ubd84\uc11d](https://www.itworld.co.kr/article/4062051)\uc5d0 \ub530\ub974\uba74, \uc774\ub294 \\"\uc870\ub9bd \ub77c\uc778\uc5d0\uc11c \ud55c \uae30\uacc4\ub9cc \uc18d\ub3c4\ub97c \ub192\uc774\uace0 \ub098\uba38\uc9c0\ub97c \uadf8\ub300\ub85c \ub450\uba74, \uacf5\uc7a5\uc774 \ube68\ub77c\uc9c0\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \ucc98\ub9ac\ub418\uc9c0 \ubabb\ud55c \uc791\uc5c5\uc774 \uc313\uc5ec\uac08 \ubfd0\\"\uc778 \uc0c1\ud669\uacfc \uac19\ub2e4. \ucf54\ub4dc\ub294 10\ubc30 \ube68\ub9ac \uc0dd\uc131\ub418\ub294\ub370, \ub9ac\ubdf0\ub294 \uc5ec\uc804\ud788 \uc0ac\ub78c\uc774 \uc77c\uc77c\uc774 \ud574\uc57c \ud55c\ub2e4\uba74 \uacb0\uad6d \uc778\uac04 \ub9ac\ubdf0\uc5b4\uac00 \ubcd1\ubaa9\uc774 \ub420 \uc218 \ubc16\uc5d0 \uc5c6\ub2e4.\\n\\n### 2. \uac80\uc99d \uccb4\uacc4\uac00 \uc5c6\ub2e4\\n\\nAI\uac00 \uc0dd\uc131\ud55c \ucf54\ub4dc\ub97c \uc5bc\ub9c8\ub098 \uc2e0\ub8b0\ud560 \uc218 \uc788\ub294\uac00? [\ucf54\ub4dc\ub798\ube57 \ubcf4\uace0\uc11c](https://www.itworld.co.kr/article/4110154)\uc5d0 \ub530\ub974\uba74, AI \uc0dd\uc131 \ucf54\ub4dc\ub294 \uc0ac\ub78c\uc774 \uc791\uc131\ud55c \ucf54\ub4dc\ubcf4\ub2e4 PR\ub2f9 1.7\ubc30 \ub354 \ub9ce\uc740 \uc774\uc288\ub97c \ubc1c\uc0dd\uc2dc\ud0a8\ub2e4. \uac1d\uad00\uc801\uc778 \uac80\uc99d \uc9c0\ud45c\uc640 \uc790\ub3d9\ud654\ub41c \ud488\uc9c8 \uac8c\uc774\ud2b8 \uc5c6\uc774\ub294, AI \uacb0\uacfc\ubb3c\uc5d0 \ub300\ud55c \ud655\uc2e0\uc744 \uac00\uc9c8 \uc218 \uc5c6\ub2e4.\\n\\n### 3. \uc219\ub828\ub3c4 \uaca9\ucc28\uac00 \ud06c\ub2e4\\n\\n\ub204\uad70\uac00\ub294 \uc815\uad50\ud55c \ud504\ub86c\ud504\ud2b8\uc640 \ucd5c\uc801\ud654\ub41c \uc5d0\uc774\uc804\ud2b8 \uc124\uc815\uc73c\ub85c \ub192\uc740 \ud488\uc9c8\uc758 \uacb0\uacfc\ubb3c\uc744 \ubf51\uc544\ub0b4\uc9c0\ub9cc, \ub204\uad70\uac00\ub294 \uae30\ubcf8\uc801\uc778 \ud65c\uc6a9\uc5d0\ub3c4 \uc5b4\ub824\uc6c0\uc744 \uacaa\ub294\ub2e4. \uac19\uc740 \ub3c4\uad6c, \uac19\uc740 \uad6c\ub3c5\ub8cc\ub97c \ub0b4\uba74\uc11c\ub3c4 \uc0dd\uc0b0\uc131 \uaca9\ucc28\ub294 \uba87 \ubc30\uc529 \ubc8c\uc5b4\uc9c4\ub2e4. \uc774 \uaca9\ucc28\ub97c \uc881\ud788\ub294 \uac83\uc740 \uac1c\uc778\uc758 \ub178\ub825\ub9cc\uc73c\ub85c\ub294 \ud55c\uacc4\uac00 \uc788\ub2e4.\\n\\n### 4. \uacbd\ud5d8\uacfc \ub178\ud558\uc6b0\uac00 \ud718\ubc1c\ub41c\ub2e4\\n\\n\uac00\uc7a5 \uc2ec\uac01\ud55c \ubb38\uc81c\ub2e4. \ube44\uc2b7\ud55c \uc5c5\ubb34\ub97c \ud558\ub294 \ud300\uc6d0\ub4e4\uc774 \uac01\uc790 \ube44\uc2b7\ud55c \ud504\ub86c\ud504\ud2b8\ub97c \ub9cc\ub4e4\uace0, \ube44\uc2b7\ud55c \uc5d0\uc774\uc804\ud2b8 \uad6c\uc131\uc744 \uc2dc\ub3c4\ud55c\ub2e4. \ub204\uad70\uac00 \ud6a8\uacfc\uc801\uc778 \ubc29\ubc95\uc744 \ubc1c\uacac\ud574\ub3c4, \uadf8 \uc9c0\uc2dd\uc740 \uac1c\uc778\uc5d0\uac8c \uba38\ubb38\ub2e4. \uc2ac\ub799\uc5d0 \uacf5\uc720\ud55c \ud301\uc740 \uba70\uce60 \ub4a4 \ubb3b\ud788\uace0, \ub178\uc158\uc5d0 \uc815\ub9ac\ud55c \uac00\uc774\ub4dc\ub294 \uc5c5\ub370\uc774\ud2b8\ub418\uc9c0 \uc54a\ub294\ub2e4. **AI\ub97c \uc798 \uc4f0\ub294 \uacbd\ud5d8\uacfc \ub178\ud558\uc6b0\uac00 \ud300\uc5d0 \ucd95\uc801\ub418\uc9c0 \uc54a\uace0 \ud718\ubc1c\ub41c\ub2e4.**\\n\\n---\\n\\n\uc774 \ub124 \uac00\uc9c0 \ubb38\uc81c\uc758 \uacf5\ud1b5\uc810\uc740 \ubb34\uc5c7\uc778\uac00? **AI \uc5ed\ub7c9\uc744 \ucd95\uc801\ud558\uace0 \uacf5\uc720\ud560 \uc6cc\ud06c\ud50c\ub85c\uc6b0\uc758 \ubd80\uc7ac**\ub2e4.\\n\\n\uac1c\uc778\uc758 \uc5ed\ub7c9\uc5d0 \uc758\uc874\ud558\ub294 \ud55c, \ud300 \uc804\uccb4\uc758 AI \ud65c\uc6a9 \uc218\uc900\uc740 \ub4e4\ucb49\ub0a0\ucb49\ud560 \uc218\ubc16\uc5d0 \uc5c6\ub2e4. \ud544\uc694\ud55c \uac83\uc740 \uac1c\uc778\uc758 \uacbd\ud5d8\uc774 \ud300\uc758 \uc790\uc0b0\uc73c\ub85c \ucd95\uc801\ub418\uace0, \uac80\uc99d\ub41c \uc6cc\ud06c\ud50c\ub85c\uc6b0\uac00 \ubaa8\ub4e0 \ud300\uc6d0\uc5d0\uac8c \uc77c\uad00\ub418\uac8c \uc801\uc6a9\ub418\ub294 \uad6c\uc870\ub2e4.\\n\\n## AI \uc2dc\ub300, \ub9ac\ub354\uac00 \ud574\uc57c \ud560 \uc77c\\n\\n\uc55e\uc73c\ub85c \ubaa8\ub4e0 \uae30\uc220 \ub9ac\ub354\ub294 **\uac1c\uc778\uc758 \uacbd\ud5d8\uc774 \ud300\uc758 \uc790\uc0b0\uc73c\ub85c \ucd95\uc801\ub418\ub294 \uad6c\uc870**\ub97c \uc124\uacc4\ud574\uc57c \ud55c\ub2e4. \uc774\uac83\uc740 \ube44\ub2e8 AI Era\ub9cc \ud574\ub2f9\ub418\ub294 \uc774\uc57c\uae30\uac00 \uc544\ub2c8\ub2e4. \ub2e4\ub9cc AI \uc2dc\ub300\uc5d0\ub294 \uc55e\uc11c \uc5b8\uae09\ud55c \uc774 \ubb38\uc81c\uac00 \ucca8\uc608\ud574\uc84c\uc744 \ubfd0\uc774\ub2e4.\\n\\n\ub9ac\ub354\uc758 \uc5ed\ud560\uc740 \uc801\uadf9\uc801\uc73c\ub85c Harness\ub97c \uad6c\ucd95\ud558\uace0, \uc774\ub97c \ud300 \uc6cc\ud06c\ud50c\ub85c\uc6b0\uc5d0 \ub179\uc5ec\ub0b4\ub294 \uac83\uc774\ub2e4. \ub2e4\uc74c\uc740 \uc774\ub97c \uc704\ud55c \ub2e4\uc12f \uac00\uc9c0 \uc6d0\uce59\uc774\ub2e4.\\n\\n### 1. \uc6cc\ud06c\ud50c\ub85c\uc6b0 \ub2e8\uacc4\ubcc4\ub85c \ub9e5\ub77d\uc744 \ubd84\ub9ac\ud558\ub77c\\n\\n\ud558\ub098\uc758 \uac70\ub300\ud55c \ud504\ub86c\ud504\ud2b8\ub85c \ubaa8\ub4e0 \uac83\uc744 \ud574\uacb0\ud558\ub824 \ud558\uc9c0 \ub9c8\ub77c. \uae30\ud68d \uac80\ud1a0, \uc124\uacc4, \uad6c\ud604, \ud14c\uc2a4\ud2b8, \ub9ac\ubdf0 - \uac01 \ub2e8\uacc4\ub294 \ud544\uc694\ub85c \ud558\ub294 \ub9e5\ub77d\uc774 \ub2e4\ub974\ub2e4. \ub2e8\uacc4\ub9c8\ub2e4 \uc801\uc808\ud55c \ucee8\ud14d\uc2a4\ud2b8\ub9cc \uc804\ub2ec\ud558\uba74 LLM\uc758 \uc720\ud55c\ud55c \ucee8\ud14d\uc2a4\ud2b8 \uc708\ub3c4\uc6b0\ub97c \ud6a8\uc728\uc801\uc73c\ub85c \ud65c\uc6a9\ud560 \uc218 \uc788\uace0, \uacb0\uacfc\ubb3c\uc758 \ud488\uc9c8\ub3c4 \ub192\uc544\uc9c4\ub2e4.\\n\\n### 2. \uacb0\uc815\uc801 \uc791\uc5c5(Deterministic Tasks)\uacfc \ube44\uacb0\uc815\uc801 \uc791\uc5c5(Non-Deterministic Task)\uc744 \uad6c\ubd84\ud558\ub77c\\n\\n\ubaa8\ub4e0 \uac83\uc5d0 LLM\uc744 \uc4f8 \ud544\uc694\ub294 \uc5c6\ub2e4.\\n\\n**\uacb0\uc815\uc801 \uc791\uc5c5**\uc740 \uaddc\uce59 \uae30\ubc18\uc73c\ub85c \ud56d\uc0c1 \uac19\uc740 \uacb0\uacfc\ub97c \ub0b4\uc57c \ud558\ub294 \uc791\uc5c5\uc774\ub2e4. \ub9b0\ud305, \ud3ec\ub9e4\ud305, \uc815\uc801 \ubd84\uc11d, \ud0c0\uc785 \uccb4\ud06c, \ubcf4\uc548 \uc2a4\uce94\uc774 \uc5ec\uae30\uc5d0 \ud574\ub2f9\ud55c\ub2e4. \uc774\ub7f0 \uc791\uc5c5\uc5d0 LLM\uc744 \uc4f0\uba74 \ubd88\ud544\uc694\ud55c \ube44\uc6a9\uacfc \ubd88\ud655\uc2e4\uc131\ub9cc \ub298\uc5b4\ub09c\ub2e4. \uc804\ud1b5\uc801\uc778 \ub3c4\uad6c\uac00 \ub354 \ube60\ub974\uace0, \ub354 \uc815\ud655\ud558\uace0, \ub354 \uc77c\uad00\uc801\uc774\ub2e4.\\n\\n**\ube44\uacb0\uc815\uc801 \uc791\uc5c5**\uc740 \ub9e5\ub77d \uc774\ud574\uc640 \ud310\ub2e8\uc774 \ud544\uc694\ud55c \uc791\uc5c5\uc774\ub2e4. \uc5ec\uae30\uac00 LLM\uc774 \uc9c4\uac00\ub97c \ubc1c\ud718\ud558\ub294 \uc601\uc5ed\uc774\ub2e4:\\n\\n- **Tidying**: \ubcc0\uc218\uba85 \uac1c\uc120, \ubd88\ud544\uc694\ud55c \uc911\ubcf5 \uc81c\uac70 \uac19\uc740 \uc791\uc740 \uc815\ub9ac \uc791\uc5c5\\n- **Reviewing**: \uc7a0\uc7ac\uc801 \ubc84\uadf8 \ud0d0\uc9c0, \uc131\ub2a5 \uc774\uc288 \uc9c0\uc801, \ucee8\ubca4\uc158 \uc704\ubc18 \ubc1c\uacac\\n- **\ubb38\uc11c\ud654**: \ucf54\ub4dc \uc8fc\uc11d, README, API \ubb38\uc11c, CHANGELOG \uc791\uc131\\n- **\ud14c\uc2a4\ud2b8 \uc0dd\uc131**: \ub2e8\uc704 \ud14c\uc2a4\ud2b8 \uc791\uc131, \uc5e3\uc9c0 \ucf00\uc774\uc2a4 \ub3c4\ucd9c, \ud14c\uc2a4\ud2b8 \ucee4\ubc84\ub9ac\uc9c0 \ud655\uc7a5\\n\\n\uacb0\uc815\uc801 \uc791\uc5c5\uc740 CI \ud30c\uc774\ud504\ub77c\uc778\uc5d0 \ub9e1\uae30\uace0, LLM\uc740 \ube44\uacb0\uc815\uc801 \uc791\uc5c5\uc5d0 \uc9d1\uc911\uc2dc\ucf1c\ub77c.\\n\\n### 3. \ubcc0\uacbd \ubc94\uc704\ub97c \uc791\uac8c \uc720\uc9c0\ud558\ub77c\\n\\nAI\uac00 \ud55c \ubc88\uc5d0 \uc218\ucc9c \uc904\uc744 \uc0dd\uc131\ud560 \uc218 \uc788\ub2e4\uace0 \ud574\uc11c, \ub9e4\ubc88 \uc218\ucc9c \uc904\uc744 \uc0dd\uc131\ud574\uc57c \ud558\ub294 \uac83\uc740 \uc544\ub2c8\ub2e4. \ud070 \ubcc0\uacbd\uc740 \ub9ac\ubdf0\uc5b4\uc758 \uc778\uc9c0 \ubd80\ud558\ub97c \ub192\uc774\uace0 \ubcd1\ubaa9\uc744 \uc720\ubc1c\ud55c\ub2e4. \ucda9\ubd84\ud788 \uac80\uc99d \uac00\ub2a5\ud558\uace0, \ubb38\uc81c\uac00 \uc0dd\uaca8\ub3c4 \uc27d\uac8c \ub864\ubc31\ud560 \uc218 \uc788\ub294 \uc791\uc740 \ub2e8\uc704\ub85c \ubcc0\uacbd\uc744 \ucabc\uac1c\uc57c \ud55c\ub2e4.\\n\\n\uadf8\ub807\ub2e4\uace0 \ubb34\uc870\uac74 \uc791\uac8c\ub9cc \uc720\uc9c0\ud558\ub77c\ub294 \uac83\uc740 \uc544\ub2c8\ub2e4. \ud575\uc2ec\uc740 **\uc778\uc9c0 \ubd80\ud558 \uc5c6\uc774 \uc790\ub3d9 \uac80\uc99d \uac00\ub2a5\ud55c \ubc94\uc704**\ub97c \ucc3e\ub294 \uac83\uc774\ub2e4.\\n\\nKent Beck\uc740 [Tidy First?](https://www.oreilly.com/library/view/tidy-first/9781098151232/)\uc5d0\uc11c \ub9ac\ud329\ud1a0\ub9c1\ubcf4\ub2e4 \uc791\uace0 \ub9b0\ud305\ubcf4\ub2e4\ub294 \uc758\ubbf8 \uc788\ub294 \'Tidying\'\uc774\ub77c\ub294 \uac1c\ub150\uc744 \uc81c\uc548\ud55c\ub2e4. \uc608\ub97c \ub4e4\uc5b4:\\n\\n- \uac00\ub4dc \ud074\ub85c\uc988\ub85c \uc911\ucca9 \uc870\uac74\ubb38 \ud3bc\uce58\uae30\\n- \uc124\uba85\ud558\ub294 \ubcc0\uc218\uba85\uc73c\ub85c \ub9e4\uc9c1 \ub118\ubc84 \ub300\uccb4\ud558\uae30\\n- \uc8fd\uc740 \ucf54\ub4dc \uc81c\uac70\ud558\uae30\\n- \ud568\uc218 \uc21c\uc11c \uc7ac\ubc30\uce58\ud558\uae30\\n\\n\uc774 \uc815\ub3c4 \uaddc\ubaa8\uc758 \ubcc0\uacbd\uc740 \ud14c\uc2a4\ud2b8\ub9cc \ud1b5\uacfc\ud558\uba74 \ubcc4\ub3c4 \ub9ac\ubdf0 \uc5c6\uc774 \uba38\uc9c0\ud574\ub3c4 \ub41c\ub2e4. \uc6cc\ud06c\ud50c\ub85c\uc6b0\ub97c \uc798 \uc124\uacc4\ud558\uba74 \uc774\ub7f0 Tidying \uc791\uc5c5\uc744 AI\uac00 \uc790\ub3d9\uc73c\ub85c \uc218\ud589\ud558\uace0, \uc790\ub3d9\uc73c\ub85c \uac80\uc99d\ud558\uace0, \uc790\ub3d9\uc73c\ub85c \uc801\uc6a9\ud558\ub294 \uac83\uc774 \uac00\ub2a5\ud558\ub2e4.\\n\\n### 4. \uc778\uac04 \uac1c\uc785\uc744 \ucd5c\uc18c\ud654\ud560 \uc218 \uc788\ub294 \uc6cc\ud06c\ud50c\ub85c\uc6b0\ub97c \ub9cc\ub4e4\uc5b4\ub77c\\n\\n\ubcd1\ubaa9\uc740 \uacb0\uad6d \uc778\uac04\uc774\ub2e4. AI\uc758 \uc0dd\uc0b0 \uc18d\ub3c4\ub97c \uc778\uac04\uc758 \ub9ac\ubdf0 \uc18d\ub3c4\uac00 \ub530\ub77c\uac08 \uc218 \uc5c6\ub2e4\uba74, \uc778\uac04 \uac1c\uc785\uc744 \ucd5c\uc18c\ud654\ud558\uc5ec AI \uacb0\uacfc\ubb3c\uc744 \uac80\uc99d\ud560 \uc218 \uc788\ub294 \uc790\ub3d9\ud654\ub41c \uc6cc\ud06c\ud50c\ub85c\uc6b0\uac00 \ud544\uc694\ud558\ub2e4.\\n\\n\uc77c\ubc18\uc801\uc73c\ub85c \uac80\uc99d \uc6cc\ud06c\ud50c\ub85c\uc6b0\ub294 \uacc4\uce35\uc801\uc73c\ub85c \uad6c\uc131\ub41c\ub2e4:\\n\\n**1\ucc28: \uacb0\uc815\uc801 \uac80\uc99d (CI \ud30c\uc774\ud504\ub77c\uc778)**\\n\\n- \ub9b0\ud305, \ud3ec\ub9e4\ud305, \ud0c0\uc785 \uccb4\ud06c \ud1b5\uacfc \uc5ec\ubd80\\n- \ud14c\uc2a4\ud2b8 \uc2a4\uc704\ud2b8 \uc804\uccb4 \ud1b5\uacfc \uc5ec\ubd80\\n- \ubcf4\uc548 \uc2a4\uce94, \uc758\uc874\uc131 \ucde8\uc57d\uc810 \uac80\uc0ac\\n\\n**2\ucc28: \ube44\uacb0\uc815\uc801 \uac80\uc99d (AI \ub9ac\ubdf0\uc5b4)**\\n\\n- PR\uc774 \uc0dd\uc131\ub418\uba74 \ub9ac\ubdf0\uc5b4 \uc5d0\uc774\uc804\ud2b8\uac00 \ubcc0\uacbd\uc810\uc744 \ubd84\uc11d\\n- \uc7a0\uc7ac\uc801 \ubc84\uadf8, \uc131\ub2a5 \uc774\uc288, \uc544\ud0a4\ud14d\ucc98 \uc704\ubc18 \ud0d0\uc9c0\\n- PR \ubcc0\uacbd\uc758 \ud575\uc2ec \ud3ec\uc778\ud2b8 \uc694\uc57d \ubc0f \uac1c\uc120 \uc81c\uc548\\n\\n**3\ucc28: \ubc94\uc704 \uae30\ubc18 \uc790\ub3d9 \uc2b9\uc778**\\n\\n- Tidying \uc218\uc900\uc758 \uc791\uc740 \ubcc0\uacbd + 1\ucc28/2\ucc28 \uac80\uc99d \ud1b5\uacfc \u2192 \uc790\ub3d9 \uba38\uc9c0\\n- \ubc84\uc800\ub2dd\uc744 \uc720\ubc1c\ud558\ub294 \ud070 \ubcc0\uacbd \u2192 \ub9ac\ubdf0 \uc0dd\uc131\\n\\n\uc5ec\uae30\uc11c [Conventional Commits](https://www.conventionalcommits.org/) \uaddc\uce59\uc774 \uc5d0\uc774\uc804\ud2b8\uc5d0\uac8c \ud78c\ud2b8\ub97c \uc904 \uc218 \uc788\ub2e4. \ucee4\ubc0b \uba54\uc2dc\uc9c0\uc5d0 `feat:`, `fix:`, `refactor:`, `chore:`, `docs:` \uac19\uc740 \ud0c0\uc785\uacfc `!`(breaking change) \ud45c\uc2dc\ub97c \uac15\uc81c\ud558\uba74, AI\uac00 \ubcc0\uacbd\uc758 \uc131\uaca9\uacfc \uc601\ud5a5 \ubc94\uc704\ub97c \uba85\ud655\ud788 \ud310\ub2e8\ud560 \uc218 \uc788\ub2e4.\\n\\n```\\nchore: \ubbf8\uc0ac\uc6a9 import \uc81c\uac70          \u2192 \uc790\ub3d9 \uba38\uc9c0 \uac00\ub2a5\\nrefactor: \uacb0\uc81c \ub85c\uc9c1 \ud568\uc218 \ubd84\ub9ac      \u2192 AI \ub9ac\ubdf0 \ud6c4 \uc790\ub3d9 \uba38\uc9c0\\nfeat!: \uc778\uc99d API \uc751\ub2f5 \uad6c\uc870 \ubcc0\uacbd     \u2192 \ubcc4\ub3c4\uc758 \ub9ac\ubdf0 \ud504\ub85c\uc138\uc2a4 \ud544\uc694\\n```\\n\\n\uc774\ub807\uac8c \uad6c\uc131\ud558\uba74 \ubc84\uc800\ub2dd\uc744 \uc720\ubc1c\ud558\ub294 \ud070 \ubcc0\uacbd\uc774 \uc544\ub2cc `chore`, `style`, `docs`, `refactor` \uc218\uc900\uc758 \ubcc0\uacbd\uc740 1\ucc28/2\ucc28 \uac80\uc99d\ub9cc \ud1b5\uacfc\ud558\uba74 \ub9ac\ubdf0\uc5b4 \uc5d0\uc774\uc804\ud2b8\uac00 \uc9c1\uc811 \uba38\uc9c0\ud560 \uc218 \uc788\ub2e4. `feat!`, `fix!` \uac19\uc740 breaking change\ub098 `feat` \uac19\uc740 \uc758\ubbf8 \uc788\ub294 \ubcc0\uacbd\ub9cc \ubcc4\ub3c4\uc758 \ub9ac\ubdf0 \ud504\ub85c\uc138\uc2a4\ub97c \ub3c4\uc785\ud558\uba74 \ub41c\ub2e4.\\n\\n\uc774 \uc6cc\ud06c\ud50c\ub85c\uc6b0\uc758 \uc218\uc900\uc774 \ub192\uc544\uc838\uc11c \ub2e4\uc18c \ud070 \ubcc0\uacbd\ub9c8\uc800\ub3c4 \ub9ac\ubdf0 \uc5d0\uc774\uc804\ud2b8\uac00 \uc778\uac04 \uc9c0\ub2a5 \uac1c\uc785 \uc5c6\uc774 \uba38\uc9c0\uac00\ub2a5\ud55c \uc218\uc900\uc73c\ub85c \uace0\ub3c4\ud654\ub41c\ub2e4\uba74 \uacb0\uad6d \ub300\ubd80\ubd84\uc758 \ubcc0\uacbd\uc774 \uc778\uac04 \uac1c\uc785 \uc5c6\uc774 \uc790\ub3d9\uc73c\ub85c \ucc98\ub9ac\ub418\uace0, \uc774 \ud300/\ud504\ub85c\uc81d\ud2b8\uc758 \uc0dd\uc0b0\uc131\uc740 \ud070 \ubcc0\uace1\uc810\uc744 \ub9de\uac8c \ub420 \uac83\uc774\ub2e4.\\n\\n### 5. \ubaa8\ub4e0 \uac1c\uc120\uc774 \ud300\uc758 \uc790\uc0b0\uc73c\ub85c \ucd95\uc801\ub418\uac8c \ud558\ub77c\\n\\n**\uc774\uac83\uc774 \uac00\uc7a5 \uc911\uc694\ud558\ub2e4.**\\n\\nAI \ub3c4\uc785\uc740 \\"\uc88b\uc740 \ub3c4\uad6c\ub97c \uc0ac\uc8fc\uba74 \ub05d\ub098\ub294\\" \ubb38\uc81c\uac00 \uc544\ub2c8\ub2e4. [2025 DORA \ub9ac\ud3ec\ud2b8](https://dora.dev/research/2025/dora-report/)\ub294 \uc131\uacf5\uc801\uc778 AI \ub3c4\uc785\uc744 \ud234 \ubb38\uc81c\uac00 \uc544\ub2c8\ub77c \uc2dc\uc2a4\ud15c \ubb38\uc81c\ub85c \uc815\uc758\ud558\uba70, AI\uc758 \uac00\uce58\ub294 \ub3c4\uad6c \uadf8 \uc790\uccb4\ubcf4\ub2e4 \uc8fc\ubcc0\uc758 \uae30\uc220\xb7\ubb38\ud654\uc801 \ud658\uacbd\uc5d0 Lock-in \ub41c\ub2e4\uace0 \ub9d0\ud55c\ub2e4.\\n\\n\ub204\uad70\uac00 \ud6a8\uacfc\uc801\uc778 \ud504\ub86c\ud504\ud2b8\ub97c \ubc1c\uacac\ud588\ub2e4\uba74, \uadf8 \ud504\ub86c\ud504\ud2b8\ub294 \ud718\ubc1c\ub418\uc9c0 \uc54a\uace0 \ud300 \uc804\uccb4\uac00 \uc4f0\ub294 \ub3c4\uad6c\uc5d0 \ubc18\uc601\ub418\uc5b4\uc57c \ud55c\ub2e4. \ub204\uad70\uac00 \uc2e4\uc218\ub97c \ubc29\uc9c0\ud558\ub294 \uc6cc\ud06c\ud50c\ub85c\uc6b0\ub97c \ub9cc\ub4e4\uc5c8\ub2e4\uba74, \uadf8 \uc6cc\ud06c\ud50c\ub85c\uc6b0\ub294 \uac1c\uc778\uc758 \uc2b5\uad00\uc774 \uc544\ub2c8\ub77c \ud300\uc758 \uc2dc\uc2a4\ud15c\uc73c\ub85c \uc790\ub9ac \uc7a1\uc544\uc57c \ud55c\ub2e4.\\n\\n\uac1c\uc778\uc774 \ubc1c\uacac\ud55c \ubca0\uc2a4\ud2b8 \ud504\ub799\ud2f0\uc2a4\uac00 \u2192 \ud300\uc758 \ud45c\uc900 \uc6cc\ud06c\ud50c\ub85c\uc6b0\uac00 \ub418\uace0 \u2192 \ubc84\uc804 \uad00\ub9ac\ub418\uba70 \u2192 \uc9c0\uc18d\uc801\uc73c\ub85c \uac1c\uc120\ub418\ub294 \uad6c\uc870.\\n\\n\uc774 \uad6c\uc870\uac00 \uc791\ub3d9\ud558\ub824\uba74, \uc870\uc9c1\uc740 **\uba85\ud655\ud558\uace0 \uacf5\uc720\ub41c AI \uc2a4\ud0e0\uc2a4(\uc815\ucc45/\uae30\ub300\uce58/\ud5c8\uc6a9 \ub3c4\uad6c/\uc801\uc6a9 \ubc94\uc704)** \ub97c \uac00\uc838\uc57c \ud55c\ub2e4. DORA \ub9ac\ud3ec\ud2b8\ub294 AI \ub3c4\uc785\uc758 \uae0d\uc815\uc801 \ud6a8\uacfc\uac00 \uc774\ub7f0 \\"clear and communicated AI stance\\"\uc758 \uc874\uc7ac\uc5d0 \uc758\uc874\ud558\uba70, \uc774\uac83\uc774 \uc788\uc744 \ub54c \uac1c\uc778 \ud6a8\uacfc\uc640 \uc870\uc9c1 \uc131\uacfc\uc758 \uae0d\uc815\uc801 \uc601\ud5a5\uc774 \uc99d\ud3ed\ub41c\ub2e4\uace0 \uc81c\uc2dc\ud55c\ub2e4.\\n\\n\uc774\uac83\uc744 \uac00\ub2a5\ud558\uac8c \ud558\ub294 \uac83\uc774 AI \uc2dc\ub300 \ub9ac\ub354\uc2ed\uc758 \ud575\uc2ec \uc5ed\ud560\uc774\ub2e4.\\n\\n---\\n\\n\ub2e4\uc74c \ud3b8\uc5d0\uc11c\ub294 \uc774 \uc6d0\uce59\ub4e4\uc744 Claude Code\uc758 Skills, Hooks, Plugins\ub85c \uad6c\ud604\ud558\ub294 \uad6c\uccb4\uc801\uc778 \ubc29\ubc95\uc744 \uc0b4\ud3b4\ubcf4\uaca0\ub2e4."},{"id":"mobile-attribution-in-the-privacy-first-era","metadata":{"permalink":"/01010011/blog/mobile-attribution-in-the-privacy-first-era","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-09-16-mobile-attribution-in-the-privacy-first-era/mobile-attribution-in-the-privacy-first-era.mdx","source":"@site/blog/2025-09-16-mobile-attribution-in-the-privacy-first-era/mobile-attribution-in-the-privacy-first-era.mdx","title":"Mobile Attribution in the Privacy First Era","description":"alt text","date":"2025-09-16T00:00:00.000Z","tags":[{"inline":true,"label":"attribution","permalink":"/01010011/blog/tags/attribution"},{"inline":true,"label":"mmp","permalink":"/01010011/blog/tags/mmp"},{"inline":true,"label":"ad-network","permalink":"/01010011/blog/tags/ad-network"},{"inline":true,"label":"skan","permalink":"/01010011/blog/tags/skan"},{"inline":true,"label":"privacy","permalink":"/01010011/blog/tags/privacy"}],"readingTime":14.255,"hasTruncateMarker":false,"authors":[{"name":"01010011","title":"Sr. Software Engineer, Engineering Manager","url":"https://01010011.blog","page":{"permalink":"/01010011/blog/authors/bahamoth"},"socials":{"x":"https://x.com/010100111010","github":"https://github.com/bahamoth","linkedin":"https://www.linkedin.com/in/byeongsu-kang-38899b86/","blog":"https://01010011.blog"},"imageURL":"https://gravatar.com/avatar/bb2519f8e198b51fdc396e8a9d5f475e?size=256","key":"bahamoth"}],"frontMatter":{"slug":"mobile-attribution-in-the-privacy-first-era","title":"Mobile Attribution in the Privacy First Era","authors":["bahamoth"],"tags":["attribution","mmp","ad-network","skan","privacy"]},"unlisted":false,"prevItem":{"title":"\uc77c\uad00\uc131 \uc788\ub294 Agentic AI Workflow\ub97c \ud300 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud558\ub294 \ubc95","permalink":"/01010011/blog/how-to-build-a-consistent-agentic-ai-workflow-for-team-projects"},"nextItem":{"title":"docker-build-hang/docker-build-hang","permalink":"/01010011/blog/2025/03/30/docker-build-hang/docker-build-hang"}},"content":"import styles from \\"../blog.module.css\\";\\n\\n![alt text](broken_bridge.png)\\n\\n## \uac1c\uc694\\n\\n\uac1c\uc778\uc815\ubcf4 \ubcf4\ud638\uc758 \uc911\uc694\uc131\uc774 \ub300\ub450\ub418\uba74\uc11c \ubaa8\ubc14\uc77c \uc5b4\ud2b8\ub9ac\ubdf0\uc120\uc758 \ud328\ub7ec\ub2e4\uc784\uc740 \ud06c\uac8c \ubcc0\ud654\ud558\uc600\ub2e4. \uacfc\uac70\uc5d0\ub294 IDFA, GAID \ub4f1\uc758 \uad11\uace0 \uc2dd\ubcc4\uc790\ub97c \ud1b5\ud574 \uba85\ud655\ud55c \uce21\uc815\uc774 \uac00\ub2a5\ud558\uc600\uc73c\ub098, \uc0ac\uc6a9\uc790\uc758 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638\ub97c \ucd5c\uc6b0\uc120\uc73c\ub85c \ud558\ub294 \ud604\ub300\uc5d0\ub294 \ub354\uc774\uc0c1 Deterministic\ud55c \uc0ac\uc6a9\uc790 \uc2dd\ubcc4\uc774 \ubd88\uac00\ub2a5\ud558\ub2e4.\\n\\n\uc774 \uae00\uc5d0\uc11c\ub294 Apple\uc758 SKAdNetwork(SKAN)\uc640 Google\uc758 Privacy Sandbox\ub85c \ub300\ud45c\ud558\ub294 \ubaa8\ubc14\uc77c \ud658\uacbd\uc758 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638 \ud504\ub808\uc784\uc6cc\ud06c\uc5d0 \ub300\ud574 \uc124\uba85\ud558\uace0, \uc5b4\ub5bb\uac8c \ud655\ub960\ub860\uc801\uc73c\ub85c \ubaa8\ubc14\uc77c \uc5b4\ud2b8\ub9ac\ubdf0\uc120\uc744 \ud68d\ub4dd\ud558\ub294\uc9c0\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uaca0\ub2e4.\\n\\n### \uc5b4\ub5bb\uac8c \uc54c\uace0 \uc624\uc168\uc5b4\uc694?\\n\\n1970\ub144\ub300, \ubbf8\uad6d \ub514\ud2b8\ub85c\uc774\ud2b8\uc758 \uc790\ub3d9\ucc28 \ud310\ub9e4\uc6d0 \'\uc870 \uc9c0\ub77c\ub4dc(Joe Girard)\'\ub294 15\ub144\uac04 13,001\ub300\uc758 \ucc28\ub97c \ud314\uc544 \'\uc138\uacc4\uc5d0\uc11c \uac00\uc7a5 \uc704\ub300\ud55c \uc138\uc77c\uc988\ub9e8\'\uc73c\ub85c \uae30\ub124\uc2a4\ubd81\uc5d0 \uc62c\ub790\ub2e4.\\n\\n\uadf8\uc758 \uc131\uacf5 \ube44\uacb0\uc740 \ucc28\ub97c \ud30c\ub294 \uae30\uc220\uc774 \uc544\ub2c8\ub77c, \uace0\uac1d\uc744 \ub04a\uc784\uc5c6\uc774 \ub9cc\ub4e4\uc5b4\ub0b4\ub294 \'\uc2dc\uc2a4\ud15c\'\uc5d0 \uc788\uc5c8\ub2e4. \uadf8\ub294 \uc790\uc2e0\uc758 \uace0\uac1d\uc774 \ub420 \ub9cc\ud55c \uc0ac\ub78c\uc744 \uc18c\uac1c\ud574 \uc8fc\ub294 \uc0ac\ub78c\ub4e4\uc744 **\'\ubc84\ub4dc \ub3c4\uadf8(Bird Dogs, \uc0ac\ub0e5\uac1c)\'** \ub77c\uace0 \ubd88\ub800\ub2e4. \uc774\ubc1c\uc0ac, \uc2dd\ub2f9 \uc8fc\uc778, \uc740\ud589\uc6d0 \ub4f1 \uc8fc\ubcc0\uc758 \ubaa8\ub4e0 \uc0ac\ub78c\uc774 \uadf8\uc758 \'\ubc84\ub4dc \ub3c4\uadf8\'\uac00 \ub420 \uc218 \uc788\uc5c8\ub2e4.  \\n\uadf8\uc758 \uaddc\uce59\uc740 \uac04\ub2e8\ud588\ub2e4. \\"\uc800\uc5d0\uac8c \uc190\ub2d8\uc744 \ubcf4\ub0b4\uc8fc\uc2ed\uc2dc\uc624. \uadf8 \uc190\ub2d8\uc774 \ucc28\ub97c \uc0ac\uba74, \uc81c\uac00 \ubc14\ub85c \ub2f9\uc2e0\uc5d0\uac8c 25\ub2ec\ub7ec\ub97c \ubcf4\ub0b4\ub4dc\ub9ac\uaca0\uc2b5\ub2c8\ub2e4.\\"  \\n\uc774 \uc2dc\uc2a4\ud15c\uc774 \uc644\ubcbd\ud558\uac8c \ub3cc\uc544\uac00\ub824\uba74 \uac00\uc7a5 \uc911\uc694\ud55c \uc804\uc81c \uc870\uac74\uc774 \uc788\uc5c8\ub2e4. \ubc14\ub85c **\\"\uc774 \uace0\uac1d\uc744 \ub204\uac00 \ubcf4\ub0c8\ub294\uac00?\\"** \ub97c \ud55c \uce58\uc758 \uc624\ucc28\ub3c4 \uc5c6\uc774 \ud30c\uc545\ud558\ub294 \uac83\uc774\uc5c8\ub2e4.  \\n\uc870 \uc9c0\ub77c\ub4dc\ub294 \uc0c8\ub85c\uc6b4 \uace0\uac1d\uc774 \uc624\uba74 \uac00\uc7a5 \uba3c\uc800 \\"\ub204\uac00 \ub2f9\uc2e0\uc744 \uc81c\uac8c \ubcf4\ub0c8\uc2b5\ub2c8\uae4c?\\"\ub77c\uace0 \ubb3c\uc5c8\ub2e4. \uadf8\ub9ac\uace0 \ud310\ub9e4\uac00 \uc131\uc0ac\ub418\uba74 \uc7a5\ubd80\uc5d0 \uaf3c\uaf3c\ud788 \uae30\ub85d\ud574 \ub450\uc5c8\ub2e4\uac00, \uc57d\uc18d\ud55c 25\ub2ec\ub7ec\ub97c \uc18c\uac1c\uc790\uc5d0\uac8c \ubc18\ub4dc\uc2dc \ubcf4\ub0c8\ub2e4.\\n\\n\uc870 \uc9c0\ub77c\ub4dc\uc758 \uc77c\ud654\uc640 \ub9c8\ucc2c\uac00\uc9c0\ub85c \ubaa8\ubc14\uc77c \uc571 \uc11c\ube44\uc2a4 \uc0dd\ud0dc\uacc4\uc5d0\uc11c\ub294 \uc5b4\ub5a4 \uad11\uace0\ud65c\ub3d9\uc774\ub098 \ub9c8\ucf00\ud305\uc774 \uace0\uac1d\uc758 \uc720\uc785\uc774\ub098 \uacb0\uc81c\ub85c \uc774\uc5b4\uc84c\ub294\uc9c0 \ucd94\uc801\ud558\uace0 \uadf8 \uacf5\ub85c\ub97c \ucc3e\uc544\ub0b4\ub294\ub370, \uadf8 \uacfc\uc815\uc744 Mobile Attribution \uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n## Deterministic Attribution\\n\\nAttribution\uc744 \uc815\ud655\ud788 \uce21\uc815\ud558\ub294 \uac83\uc740 \ub9e4\uc6b0 \uc911\uc694\ud558\ub2e4. \uc774 \uc190\ub2d8\uc774 \uc774\ubc1c\uc0ac\uc758 \uc18c\uac1c\ub97c \ubc1b\uace0 \uc654\ub294\uc9c0, \uc740\ud589\uc6d0\uc758 \uc18c\uac1c\ub97c \ubc1b\uace0 \uc654\ub294\uc9c0\ub97c \uc54c\uc544\uc57c \ub204\uad6c\uc5d0\uac8c \uc5bc\ub9c8\uc758 \uad11\uace0\ub8cc\ub97c \uc904\uc9c0 \ud310\ub2e8\ud560 \uc218 \uc788\uae30 \ub54c\ubb38\uc774\ub2e4.  \\n\'\uc774 \uc190\ub2d8\uc740 \ub204\uad6c\uc758 \uc18c\uac1c\ub97c \ubc1b\uace0 \uc654\ub294\uac00?\' \uc774 \uc9c8\ubb38\uc5d0 \ub2f5\ud558\uae30 \uc704\ud574 \ubaa8\ubc14\uc77c \ud50c\ub7ab\ud3fc\uc740 Ad Network\uc5d0\uac8c \ub2e4\uc74c \uc815\ubcf4\ub97c \uc804\ub2ec\ud558\uc600\ub2e4.\\n\\n- **IDFA (Identifier for Advertisers):** Apple\uc774 iOS \uae30\uae30\ub97c \uc704\ud574 \uc81c\uacf5\ud558\ub294, \uc0ac\uc6a9\uc790\uac00 \uc7ac\uc124\uc815\ud560 \uc218 \uc788\ub294 \uad11\uace0 \uc2dd\ubcc4\uc790\\n- **GAID (Google Advertising ID):** Google\uc774 Google Play \uc11c\ube44\uc2a4\uac00 \uc124\uce58\ub41c Android \uae30\uae30\ub97c \uc704\ud574 \uc81c\uacf5\ud558\ub294 \uad11\uace0 \uc2dd\ubcc4\uc790\\n\\nIDFA, GAID\ub294 \ubaa8\ub450 \uc0ac\uc6a9\uc790\uc758 \uae30\uae30\ub97c \uc815\ud655\ud788 \uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uace0\uc720\uc758 \uac12\uc774\ub2e4. \ub530\ub77c\uc11c IDFA \uc640 GAID \ub97c \uc54c\uba74 \uc815\ud655\ud55c Mobile Attribution\uc744 \ud68d\ub4dd\ud560 \uc218 \uc788\ub2e4.\\n\\n1. \uc0ac\uc6a9\uc790\uac00 \uad11\uace0\ub97c \ud074\ub9ad\\n2. Ad Network\ub294 \ud574\ub2f9 \uae30\uae30\uc758 IDFA / GAID\ub97c \ucea1\ucc98 \ud6c4 \uc800\uc7a5\\n3. \uc0ac\uc6a9\uc790\uac00 \uc571\uc744 \uc124\uce58, \ucc98\uc74c\uc73c\ub85c \uc2e4\ud589\\n4. 100% \uc815\ud655\ud55c \uc0ac\uc6a9\uc790 \uc720\uc785 \uacbd\ub85c\ub97c \uc54c \uc218 \uc788\ub294 Attribution \ud68d\ub4dd\\n\\n\uc774\ub7ec\ud55c Deterministic \ud55c Attribution \ud68d\ub4dd \ubc29\uc2dd\uc73c\ub85c \uc778\ud574, \uad11\uace0\uc8fc\ub4e4\uc740 \uc5b4\ub5a4 \uad11\uace0\uac00 \uc5b4\ub5a4 \uc0ac\uc6a9\uc790\ub97c \uc720\uc785\uc2dc\ucf30\ub294\uc9c0\uc5d0 \ub300\ud55c \uba85\ud655\ud55c \ub370\uc774\ud130\ub97c \ud655\ubcf4\ud560 \uc218 \uc788\uc5c8\uace0, \uc774\ub294 \ubaa8\ubc14\uc77c \uad11\uace0 \uc0dd\ud0dc\uacc4\ub97c \uc131\uc7a5\uc2dc\ud0a4\ub294 \uae30\ubc18\uc774\uc5c8\ub2e4. \ud558\uc9c0\ub9cc \uc774\uc81c \uacf5\uc9dc\uc810\uc2ec\uc740 \ub05d\ub0ac\ub2e4. \ubaa8\ubc14\uc77c \ud50c\ub7ab\ud3fc\uc758 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638 \uac15\ud654 \uae30\uc870 \uc544\ub798, \uc0ac\uc6a9\uc790 \ub3d9\uc758 \uc5c6\uc774 Deterministic Attribution \ud68d\ub4dd\uc740 \ubd88\uac00\ub2a5\ud558\ub2e4. \uc774 \uae00\uc744 \uc77d\uace0 \uc788\ub294 \ub2f9\uc2e0\ub3c4 \uadf8\ub7ec\uaca0\uc9c0\ub9cc, \uc0ac\uc6a9\uc790\ub4e4\uc740 \ub354 \uc774\uc0c1 \ub098\ub97c \ud2b9\uc815\ud560 \uc218 \uc788\ub294 \uac1c\uc778\uc815\ubcf4 \uc81c\uacf5\uc5d0 \ub3d9\uc758\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\\n## Probabilistic Attribution\\n\\n### Apple\uc758 ATT(AppTrackingTransparency)\uc640 SKAN(SKAdNetwork) Framework\\n\\n\uc0c1\uc220\ud558\uc600\ub4ef, \uc560\ud50c\uc740 \ub354 \uc774\uc0c1 \uc0ac\uc6a9\uc790 \ub3d9\uc758 \uc5c6\uc774 IDFA\ub97c \uc81c\uacf5\ud558\uc9c0 \uc54a\ub294\ub2e4.(\uc815\ud655\ud788 \ub9d0\ud558\uba74 \'\uba85\uc2dc\uc801\uc778\' \uc0ac\uc6a9\uc790 \ub3d9\uc758 \uc5c6\uc774).\\n\\n![empty IDFA](empty_idfa.png)\\n\\n\ub530\ub77c\uc11c iOS14+ \uc774\ud6c4\ubd80\ud130\ub294 \uae30\uae30\uc758 IDFA \uac12\uc744 \uac00\uc838\uc624\ub824\uba74 ATT(AppTrackingTransparency) \ud504\ub808\uc784\uc6cc\ud06c\ub97c \ud1b5\ud574 \ubc18\ub4dc\uc2dc \uba85\uc2dc\uc801\uc73c\ub85c \uc0ac\uc6a9\uc790\uc758 \uad8c\ud55c\uc744 \ud68d\ub4dd\ud558\uc5ec\uc57c \ud55c\ub2e4. \uc0ac\uc6a9\uc790\uac00 \ub3d9\uc758\ub97c \uac70\ubd80\ud558\uba74 \uc0c1\uae30 \uc2a4\uc0f7\uacfc \uac19\uc774 IDFA \uac12\uc740 000000~ \uc73c\ub85c \ube44\uc6cc\uc9c4\ub2e4.\\n\\n\uc774\ub294 \uad11\uace0\uc8fc \ubc0f Ad Network \ubaa8\ub450\uc5d0\uac8c \uce58\uba85\uc801\uc778 \ubb38\uc81c\ub2e4. \ub0b4 \uad11\uace0\uac00 \ub204\uad6c\uc5d0 \uc758\ud574 \ub178\ucd9c\uc774 \ub418\uc5c8\ub294\uc9c0 \uba85\ud655\ud788 \uc54c\uc9c0 \ubabb\ud558\uae30 \ub54c\ubb38\uc5d0 \uc5b4\ub290 \uacbd\ub85c\ub97c \ud1b5\ud574 \uace0\uac1d\uc774 \uc720\uc785\ub418\uc5c8\ub294\uc9c0 \ud30c\uc545\ud560 \uc218 \uc5c6\uace0, \uad11\uace0 \ube44\uc988\ub2c8\uc2a4\uc758 \ub300\uc804\uc81c(\uc5b4\ub5bb\uac8c \uc54c\uace0 \uc624\uc168\uc5b4\uc694?)\uac00 \ubb34\ub108\uc9c0\uac8c \ub41c\ub2e4.\\n\\n\ub300\uc548\uc73c\ub85c, \uc560\ud50c\uc740 \uac1c\uc778\uc744 \ud2b9\uc815\ud560 \uc218\ub294 \uc5c6\ub294 \uc81c\ud55c\ub41c \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\ub294 \uad11\uace0 \uc2dd\ubcc4\uc790 \ud68d\ub4dd \ubc29\uc2dd\uc744 \uc81c\uacf5\ud558\ub294\ub370, \uadf8\uac83\uc774 SKAN(SKAdNetwork)\uc774\ub2e4.\\n\\n![SKAN winning flow](skan_flow.png)\\n\\nSKAN \uc758 \ub370\uc774\ud130 \ud750\ub984\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n1. Ad Network: \uad11\uace0\ub97c \uac1c\uc81c\\n2. Ad Network: \uc81c\ud55c\ub41c Attribution(Postback) \uc218\uc9d1 URL \ub4f1\ub85d\\n3. \uc0ac\uc6a9\uc790: \uad11\uace0\ub97c \ud074\ub9ad -> \uc571 \uc124\uce58\\n4. Apple: \uad11\uace0\uc0ac\uc5c5\uc790\uac00 \uac1c\uc778 \ucd94\uc801\uc774 \uc5b4\ub835\ub3c4\ub85d \uc77c\uc815 \uae30\uac04 \uc9c0\uc5f0(~\ucd5c\ub300 144\uc2dc\uac04)\\n5. Ad Network: \uc77c\uc815\uc2dc\uac04 \uacbd\uacfc \ud6c4 Postback \uc73c\ub85c \ucea0\ud398\uc778 ID \ubc0f \uc81c\ud55c\ub41c \uc0ac\uc6a9\uc790 \uc815\ubcf4(Conversion Value) \uc218\uc2e0(IDFA \uc5c6\uc74c)\\n\\n\uc5ec\uae30\uc11c \uc720\uc77c\ud558\uac8c \uc0ac\uc6a9\uc790 \uc815\ubcf4\ub97c \uc5bb\uc5b4\ub0bc \uc218\ub2e8\uc740 CV(Conversion Value) \ubfd0\uc774\ub2e4. CV\ub294 0~63 \uc0ac\uc774\uc758 \uc815\uc218\ub85c \ud45c\ud604\ub418\ub294 6bit \uac12\uc73c\ub85c, \uad11\uace0\uc8fc\ub294 64 \uac00\uc9c0 \uac12\uc5d0 \ub9e4\ud551\ud558\uc5ec \uc0ac\uc6a9\uc790\uc758 \uc571 \uc124\uce58 \ud6c4 \ud589\ub3d9\uc744 \uc218\uc9d1\ud560 \uc218 \uc788\ub2e4. \uc608\ub97c \ub4e4\uc5b4 CV\uac00 1\uc774\uba74 \ud29c\ud1a0\ub9ac\uc5bc \uc644\ub8cc, CV\uac00 2\uc774\uba74 \ucd5c\ucd08 \uc778\uc571 \uad6c\ub9e4 \uc644\ub8cc \ub4f1\uc758 \uac12\uc744 \uc0ac\uc804\uc5d0 \uc815\uc758, Postback \uc2dc\uc810\uc5d0 \ud68d\ub4dd\ud558\uc5ec \uc0ac\uc6a9\uc790\ub97c \ubd84\uc11d\ud560 \uc218 \uc788\ub2e4. \uc54c\uace0 \uc788\uaca0\uc9c0\ub9cc 6bit \ub294 \uba54\uc6b0 \uc81c\ud55c\ub41c \uac12\uc73c\ub85c, CV\ub97c \ub2e8\ub3c5\uc73c\ub85c \uc774\uc6a9\ud558\uc5ec \uc0ac\uc6a9\uc790\ub97c \ud2b9\uc815\ud560 \ubc29\ubc95\uc740 \uc5c6\ub2e4.\\n\\n\ub9d0\ud558\uc790\uba74 Apple \uc740 \ub370\uc774\ud130 \uce21\uc815\uc758 \uc2ec\ud310\uc774\uc790 \uc720\uc77c\ud55c \ucc98\ub9ac\uc790 \uc5ed\ud560\uc744 \uc790\ucc98\ud55c\ub2e4. \uad11\uace0\uc8fc, Ad Network \ub294 \ubaa8\ub450 Apple \uc774 \uc815\ud574\ub454 \uc5c4\uaca9\ud55c \uaddc\uce59 \uc548\uc5d0\uc11c Apple\uc774 \uc81c\uacf5\ud558\ub294 \ucd5c\uc885 \uacb0\uacfc\ubb3c\uc744 \uc218\ub3d9\uc801\uc73c\ub85c \ubc1b\uc544 \ud574\uc11d\ud574\uc57c \ud55c\ub2e4.\\n\\n### Android \uc758 Privacy Sandbox\uc640 Attribution Reporting API\\n\\n\uc55e\uc11c Apple\uc774 \ubaa8\ub4e0 Attribution \ud68d\ub4dd \uacbd\ub85c\uc5d0 \uad00\uc5ec, \ud1b5\uc81c\ud558\uba74\uc11c \uacb0\uacfc\ub9cc \uc804\ub2ec\ud558\ub294 \ubc29\uc2dd\uacfc\ub294 \ub300\uc870\uc801\uc73c\ub85c, Google\uc740 \uad11\uace0 \uc0dd\ud0dc\uacc4 \ucc38\uc5ec\uc790\ub4e4\uc774 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638 \uae30\uc220\uc744 \uae30\ubc18\uc73c\ub85c \uc790\uccb4\uc801\uc778 \ud504\ub77c\uc774\ubc84\uc2dc \ubcf4\ud638 \uc194\ub8e8\uc158\uc744 \uad6c\ucd95\ud560 \uc218 \uc788\ub3c4\ub85d \ube4c\ub529\ube14\ub85d\uc744 \uc81c\uacf5\ud55c\ub2e4. \uadf8 \ud575\uc2ec \ube4c\ub529\ube14\ub85d\uc774 \ubc14\ub85c Privacy Sandbox \uc774\ub2e4.\\n\\nPrivacy Sandbox\ub294 \ub2e4\uc74c 3\uac00\uc9c0 \ud575\uc2ec \ubaa9\ud45c\ub97c \uac16\ub294\ub2e4.\\n\\n1. \uae30\uc874\uc758 \ucd94\uc801 \uba54\ucee4\ub2c8\uc998\uc744 \ub300\uccb4\ud560 \uc0c8\ub85c\uc6b4 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638\uae30\uc220\uc744 \uad6c\ucd95\ud558\ub294 \uac83.\\n2. \ud37c\ube14\ub9ac\uc154\uc640 \uac1c\ubc1c\uc790\uac00 \uce68\ud574\uc801\uc778 \ucd94\uc801 \uc5c6\uc774\ub3c4 \ubb34\ub8cc \uc628\ub77c\uc778 \ucee8\ud150\uce20\ub97c \uacc4\uc18d \uc81c\uacf5\ud560 \uc218 \uc788\ub3c4\ub85d \uc9c0\uc6d0\ud558\ub294 \uac83.\\n3. \uc5c5\uacc4\uc640\uc758 \ud611\ub825\uc744 \ud1b5\ud574 \uc0c8\ub85c\uc6b4 \uc778\ud130\ub137 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638 \ud45c\uc900\uc744 \uad6c\ucd95\ud558\ub294 \uac83.\\n\\n\uc694\uc57d\ud558\uba74, \uac1c\uc778\uc815\ubcf4\ub97c \ubcf4\ud638\ud558\uba74\uc11c\ub3c4 \ud37c\ube14\ub9ac\uc154\uc640 \uac1c\ubc1c\uc790\uac00 \uad11\uace0 \uae30\ubc18 \ube44\uc988\ub2c8\uc2a4\ub97c \uc9c0\uc18d\ud560 \uc218 \uc788\ub3c4\ub85d \ud558\ub294 \uc5c5\uacc4 \ud45c\uc900\uc744 \ub9cc\ub4dc\ub294 \uac83\uc774\ub2e4.\\n\\n![Privacy Sandbox flow](sandbox_flow.png)\\n\\nGoogle\uc758 Privacy Sandbox\uac00 \uae30\uc874\uc758 Attribution \ud68d\ub4dd\ubc29\uc2dd\uacfc \uae30\uc220\uc801\uc73c\ub85c \uac00\uc7a5 \ud06c\uac8c \uad6c\ubcc4\ub418\ub294 \ubd80\ubd84\uc740 \uc0ac\uc6a9\uc790 \ub514\ubc14\uc774\uc2a4 \uc548\uc5d0\uc11c Ad Network \uc815\ubcf4\uc640 \ub9e4\uce6d\ub418\ub294 Attribution\uc744 \ub9cc\ub4e4\uc5b4\ub0b8\ub2e4\ub294 \uc810\uc774\ub2e4.\\n\\n\ub514\ubc14\uc774\uc2a4 \uc548\uc5d0\uc11c Attribution\uc744 \ud68d\ub4dd\ud558\uae30 \ub54c\ubb38\uc5d0 \uad11\uace0 \ube44\uc988\ub2c8\uc2a4 \uc0ac\uc5c5\uc790\ub294 \uc0ac\uc6a9\uc790\uc758 \uac1c\uc778\uc815\ubcf4\ub97c \ub514\ubc14\uc774\uc2a4 \ubc16\uc73c\ub85c \ube7c\ub0b4\uc9c0 \ub118\uae30\uc9c0 \uc54a\uace0\ub3c4 \uc720\uc758\ubbf8\ud55c \uc0ac\uc6a9\uc790 \uc804\ud658 \uc815\ubcf4\ub97c \uc5bb\uc744 \uc218 \uc788\ub2e4.\\n\\n\uc774\ub807\uac8c \uc0ac\uc6a9\uc790 \ub2e8\ub9d0\uc5d0\uc11c \uc0dd\uc131\ub41c \uc775\uba85\ud654\ub41c Attribution\uc740 Attribution Reporting API(\uc904\uc5ec\uc11c ARA)\ub97c \ud1b5\ud574 \uc218\uc9d1\ub41c\ub2e4.\\n\\nARA\ub97c \ud1b5\ud574 \uc218\uc9d1\ub418\ub294 \ub9ac\ud3ec\ud2b8\ub294 \ud06c\uac8c 2\uac00\uc9c0 \uc720\ud615\uc774 \uc874\uc7ac\ud55c\ub2e4.\\n\\n- **Event-Level Report:** \\"\uc5b4\ub5a4 \uad11\uace0\uac00 \uc804\ud658\uc744 \uc720\ub3c4\ud588\ub294\uac00?\\"\uc640 \uac19\uc774 \uc81c\ud55c\uc801\uc774\uc9c0\ub9cc \uc138\ubd84\ud654\ub41c \uc815\ubcf4\\n- **Summary Reports:** \\"\ucea0\ud398\uc778\uc758 \ucd1d\ub9e4\ucd9c\uc561\uacfc ROI\ub294 \uc5bc\ub9c8\uc778\uac00?\\"\uc640 \uac19\uc774 \uad6c\ub9e4 \uae08\uc561 \ub4f1 \uc0c1\uc138\ud55c \uc804\ud658 \ub370\uc774\ud130\ub97c \uc554\ud638\ud654 \ubc0f \uc9d1\uacc4\ub41c \ud615\ud0dc\ub85c \uc81c\uacf5\\n\\nEvent Level Report\ub294 \uc775\uba85\ud654\ub41c \uac1c\ubcc4 \uc815\ubcf4\uc774\ub2e4. \uac1c\ubcc4\uc815\ubcf4\uc774\uc9c0\ub9cc \uc775\uba85\ud654 \ub418\uc5b4 \uc788\uae30 \ub54c\ubb38\uc5d0 \ub9ce\uc740 \uc815\ubcf4\uac00 \ub2f4\uaca8\uc788\uc9c0\ub294 \uc54a\ub2e4. Attribution \uc815\ubcf4\uc640 \uc0ac\uc6a9\uc790 \ud074\ub9ad, \uc870\ud68c \ub4f1\uc758 \uc774\ubca4\ud2b8\ub97c \ub9e4\ud551\ud55c \ub370\uc774\ud130\ub97c \uc81c\uacf5\ud55c\ub2e4. \uc774 \ub9ac\ud3ec\ud2b8\ub294 \ucea0\ud398\uc778 \ub3c4\ub2ec\uc728 \uce21\uc815\uc774\ub098 Attribution \uc9d1\uacc4 \ub4f1\uc758 \uc6a9\ub3c4\ub85c \uc801\ud569\ud558\ub2e4.\\n\\n\ubc18\uba74, Summary Report\ub294 \uc0ac\uc6a9\uc790 \ub370\uc774\ud130\ub97c \uc9d1\uacc4\ud55c \ud1b5\uacc4 \uacb0\uacfc\ubb3c\uc774\ub2e4. \uac1c\ubcc4\ud654\ub41c \uc815\ubcf4\ub294 \uc5c6\uc9c0\ub9cc \uc804\ud658\uac00\uce58, ROI, \uc0ac\uc6a9\uc790 \uc138\uadf8\uba3c\ud2b8 \ubcc4 \ucea0\ud398\uc778 \uc131\uacfc\ubd84\uc11d \ub4f1 \uae4a\uc774\uc788\ub294 \ub9ac\ud3ec\ud2b8\ub97c \uc81c\uacf5\ud55c\ub2e4.\\n\\n\uc774 \ub370\uc774\ud130\ub4e4\uc740 \uc554\ud638\ud654\ub41c \ud615\ud0dc(=encrypted aggregatable report)\ub85c Ad tech platform(Appsflyer, Meta, Applovin \ub4f1\ub4f1..)\uc5d0\uac8c \uc804\ub2ec\ub418\uba70, \uc774 \uc554\ud638\ud654\ub41c \ub370\uc774\ud130\ub97c \uae30\ubc18\uc73c\ub85c \ud544\uc694\ud55c \ucffc\ub9ac\ub97c Cloud Trusted Execution Environment\uc5d0 \uc704\uce58\ud55c Aggregation Service \uc5d0 \uc9c8\uc758\ud55c\ub2e4.\\n\\n> **Cloud Trusted Execution Environment(TEE)?**  \\n> TEE\ub780 \uad6c\uae00\uc5d0\uc11c \uc81c\uc548\ud558\ub294 \ubcf4\uc548 \uae30\uc900\uc744 \ucda9\uc871\ud558\ub294 & \uc2e0\ub8b0\ud560\ub9cc\ud55c \ud074\ub77c\uc6b0\ub4dc \uc81c\uacf5\uc790\uc758 \uc778\ud504\ub77c \uc704\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 \uaca9\ub9ac\ub41c \ud658\uacbd\uc774\ub2e4. TEE\uc758 \ubcf4\uc548 \uae30\uc900\uc744 \ucda9\uc871\ud558\uba74 Ad Tech Platform \uae30\uc5c5\uc5d0\uc11c \uc790\uccb4\uc801\uc73c\ub85c \uad6c\ucd95, \uc6b4\uc601\ud560 \uc218 \uc788\ub2e4.\\n\\n## Executive Summary\\n\\n\uc9c0\uae08\uae4c\uc9c0 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638\uc758 \uc2dc\ub300\uc5d0 \uc5b4\ub5bb\uac8c Mobile Attribution \uc744 \ud68d\ub4dd\ud560 \uac83\uc778\uac00\uc5d0 \ub300\ud55c \ub0b4\uc6a9\uc744 \uc54c\uc544\ubcf4\uc558\ub2e4. \uacfc\uac70\ucc98\ub7fc Deterministic\ud558\uac8c Attribution\uc744 \ud68d\ub4dd\ud558\ub358 \uc2dc\ub300\ub294 \ub05d\ub0ac\uc73c\uba70, \uac01 \uc774\ud574\uad00\uacc4\uc790\ub4e4\uc740 \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638\uc758 \uc2dc\ub300\uc758 Attribution \ud68d\ub4dd \ubc29\uc2dd\uc744 \uc900\ube44\ud574\uc57c \ud55c\ub2e4.\\n\\n\uacb0\uc815\ub860\uc801 \uc2dc\ub300\uc758 \uc885\ub9d0: \uac1c\uc778\uc815\ubcf4 \ubcf4\ud638 \uac15\ud654\ub85c IDFA, GAID \uae30\ubc18\uc758 1:1 \uc0ac\uc6a9\uc790 \ucd94\uc801\uc774 \ubd88\uac00\ub2a5\ud574\uc84c\ub2e4.\\n\\n\ud655\ub960\ub860\uc801 \uc2dc\ub300\ub85c\uc758 \uc804\ud658: \uc774\uc81c\ub294 \uba85\ud655\ud55c \ub370\uc774\ud130 \ub300\uc2e0, \uc81c\ud55c\ub41c \ub370\uc774\ud130\ub97c \ubc14\ud0d5\uc73c\ub85c \uc131\uacfc\ub97c \'\ucd94\ub860\'\ud574\uc57c \ud55c\ub2e4.\\n\\nApple (SKAN)\uc758 \uc811\uadfc: Apple\uc774 \ubaa8\ub4e0 \uacfc\uc815\uc744 \ud1b5\uc81c\ud558\ub294 \'\ube14\ub799\ubc15\uc2a4\' \ubc29\uc2dd\uc774\ub2e4.\\n\\nGoogle (\uc0cc\ub4dc\ubc15\uc2a4)\uc758 \uc811\uadfc: **\'\uc628\ub514\ubc14\uc774\uc2a4 \ub9e4\uce6d\'** \uc744 \ud575\uc2ec\uc73c\ub85c, \uad11\uace0 \uc0dd\ud0dc\uacc4\uac00 \ud65c\uc6a9\ud560 \uc218 \uc788\ub294 **\'\ube4c\ub529 \ube14\ub85d\'** \uc744 \uc81c\uacf5\ud55c\ub2e4.\\n\\nAd Tech\uc758 \uc5ed\ud560 \ubcc0\ud654: MMP, \uad11\uace0 \ub124\ud2b8\uc6cc\ud06c \ub4f1 Ad Tech\ub294 \uc554\ud638\ud654\ub41c \ub9ac\ud3ec\ud2b8\ub97c \ubc1b\uc544, \uc9c1\uc811 \ud074\ub77c\uc6b0\ub4dc \ubcf4\uc548 \ud658\uacbd(TEE)\uc5d0 **\'Aggregation Service\'** \ub97c \uad6c\ucd95\ud558\uace0 \uc6b4\uc601\ud558\uc5ec \ub370\uc774\ud130\ub97c \ucc98\ub9ac\ud574\uc57c \ud55c\ub2e4."},{"id":"/2025/03/30/docker-build-hang/docker-build-hang","metadata":{"permalink":"/01010011/blog/2025/03/30/docker-build-hang/docker-build-hang","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-03-30-docker-build-hang/docker-build-hang.md","source":"@site/blog/2025-03-30-docker-build-hang/docker-build-hang.md","title":"docker-build-hang/docker-build-hang","description":"---","date":"2025-03-30T00:00:00.000Z","tags":[],"readingTime":2.565,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"prevItem":{"title":"Mobile Attribution in the Privacy First Era","permalink":"/01010011/blog/mobile-attribution-in-the-privacy-first-era"},"nextItem":{"title":"should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs","permalink":"/01010011/blog/2025/03/20/should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs"}},"content":"---\\nslug: docker-build-hang\\ntitle:Docker build\uac00 \uac00\ub054\uc529 \uba48\ucd94\ub294 \uc774\uc720\ub294?\\nauthors: [bahamoth]\\ntags: [alpine, docker, mtu, mss-clamping, pmtud]\\n---\\n\\nimport styles from \'../blog.module.css\';\\n\\n## CI\uac00 \uac00\ub054\uc529 \uc2e4\ud328\ub97c \ud55c\ub2e4.  \\nCI\uac00 \uac00\ub054\uc529 \uc2e4\ud328\ub97c \ud55c\ub2e4.  \\n\\n\uc774\uc720\ub294 alpine linux docker image\ub97c multi-stage build\ud560 \ub54c \uac04\ud5d0\uc801\uc73c\ub85c hang\uc774 \ubc1c\uc0dd\ud558\uae30 \ub54c\ubb38\uc774\ub2e4.  \\n\ub2e4\ub978 os\uc5d0\uc11c\ub294? ubuntu docker build \uc5d0\uc11c\ub3c4 \uc804\ud600 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\ub294\ub2e4. \uc624\uc9c1 hang\uc740 alpine linux\ub97c \uc774\uc6a9\ud558\uc5ec apk add\ub97c \uc218\ud589\ud560 \ub54c \uac04\ud5d0\uc801\uc73c\ub85c \ubc1c\uc0dd\ud55c\ub2e4.  \\n\uace4\ub780\ud558\uac8c\ub3c4 hang\uc740 \ub9e4\ubc88 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\ub294\ub2e4. 10\ubc88 \uc2dc\ub3c4\ud558\uba74 4~5\ubc88 \uc815\ub3c4? \ub300\uac1c\ub294 `apk add gcc` \ub97c \uc218\ud589\ud560 \ub54c \uac78\ub9ac\uc9c0\ub9cc, \uac00\ub054\uc529 `apk add python` \uc774\ub098 \ub2e4\ub978 package \ube4c\ub4dc\ud560 \ub54c\ub3c4 \ubc1c\uc0dd\uc740 \ud55c\ub2e4.  \\n\uc774 \ud604\uc0c1\uc740 \ud37c\ube14\ub9ad \ub124\ud2b8\uc6cc\ud06c\ub97c \uc774\uc6a9\ud558\ub294 \ub0b4 \uac1c\uc778 PC\uc5d0\uc11c\ub294 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\uc73c\uba70, \uc624\uc9c1 \ud68c\uc0ac\uc758 \uaca9\ub9ac\ub41c private network\uc5d0\uc11c\ub9cc \ubc1c\uc0dd\ud55c\ub2e4.  \\n\uc774\ub807\uac8c \uac04\ud5d0\uc801\uc73c\ub85c \ubc1c\uc0dd\ud558\ub294 \ubb38\uc81c\ub294 \ucd94\uc801\ud558\uae30\uac00 \ud798\ub4e4\ub2e4. \uc6d0\uc778\uc744 \ud2b9\uc815\ud558\uace0 \uc815\ud655\ud788 \uc7ac\ud604\ud574 \ub0b4\uae30\uac00 \uc5b4\ub835\uae30 \ub54c\ubb38\uc774\ub2e4.  \\n\\n## Maximum Transmission Unit(MTU)\\n\uadf8\ub098\ub9c8 \uc6b0\ub9ac\uc5d0\uac8c \uc8fc\uc5b4\uc9c4 \ub2e8\uc11c\ub294 \uc774 \ud604\uc0c1\uc774 \uc0ac\ub0b4 \ub124\ud2b8\uc6cc\ud06c\uc640 \uc5f0\uad00\uc774 \uc788\ub2e4\ub294\uac70\ub2e4. \ub124\ud2b8\uc6cc\ud06c \uad00\ub828\ud55c \uc124\uc815\uc744 \uc774\uac83 \uc800\uac83 \ubc14\uafb8\uac70\ub098 tcp packet\uc744 \ucea1\ucc98\ud558\ub294 \uc2dc\ub3c4\ub97c \ud574\ubcfc \uc218 \uc788\ub2e4.  \\n\ub124\ud2b8\uc6cc\ud06c \uad00\ub828\ud55c \uc5ec\ub7ec \uac00\uc9c0 \uc2dc\ub3c4\ub97c \ud558\uc600\uace0, \uadf8 \uacb0\uacfc \ubb38\uc81c\uc758 \uc6d0\uc778\uc744 \uc881\ud790 \ub2e4\ub978 \ub2e8\uc11c\ub97c \ucc3e\uc744 \uc218 \uc788\uc5c8\ub2e4.  \\n`docker build --network host` \uc635\uc158\uc5d0\uc11c\ub294 hang\uc774 \uc804\ud600 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\ub294\ub2e4. \ubb38\uc81c\ub294 docker0 bridge network\ub97c \uc0ac\uc6a9\ud560 \ub54c\ub9cc \ubc1c\uc0dd\ud55c\ub2e4.  \\n\ub180\ub78d\uac8c\ub3c4 docker0 interface\uc758 mtu size \ub97c 500 \uae4c\uc9c0 \uc904\uc600\ub354\ub2c8 \uc99d\uc0c1\uc774 \uc0ac\ub77c\uc9c0\ub294 \uac83\uc744 \ubc1c\uacac\ud558\uc600\ub2e4.(\uc885\uc804 mtu=1500, host\uc640 \ub3d9\uc77c)  \\n\\n\uc9c0\uae08\uae4c\uc9c0\uc758 \ud604\uc0c1\uc744 \uc815\ub9ac\ud558\uba74,\\n* \ud2b9\uc815 private network \ud658\uacbd\uc5d0\uc11c\\n* docker bridge network \ub97c \uc774\uc6a9\ud558\uc5ec\\n* alpine linux \uc758 apk add \uba85\ub839\uc744 \uc218\ud589\ud560 \ub54c\\n* \uac04\ud5d0\uc801\uc73c\ub85c(4~5\uac74 / 10\ud68c) network hang \ubc1c\uc0dd\\n\\n##"},{"id":"/2025/03/20/should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs","metadata":{"permalink":"/01010011/blog/2025/03/20/should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-03-20-should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs.md","source":"@site/blog/2025-03-20-should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs.md","title":"should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs","description":"---","date":"2025-03-20T00:00:00.000Z","tags":[],"readingTime":2.255,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"prevItem":{"title":"docker-build-hang/docker-build-hang","permalink":"/01010011/blog/2025/03/30/docker-build-hang/docker-build-hang"},"nextItem":{"title":"macOS\uc5d0\uc11c \ud2b9\uc815 \ub2e8\ucd95\uc5b4\ub97c \ub204\ub97c \ub54c\ub9cc \ub4e4\ub9ac\ub294 beep\uc74c \uc5c6\uc560\uae30","permalink":"/01010011/blog/how-to-mute-the-weired-beep-sound"}},"content":"---\\nslug: should-i-still-write-blogs\\ntitle: AI \uc2dc\ub300\uc5d0 \uc5ec\uc804\ud788 \ube14\ub85c\uadf8\ub97c\uc368\uc57c \ud560\uae4c?\\nauthors: [bahamoth]\\ntags: [AI, blog]\\n---\\n\\nimport styles from \'../blog.module.css\';\\n\\nAI\uc758 \uc2dc\ub300, \uc704\uae30\uc758 \uae00\uc4f0\uae30 - \uae30\uc220 \ube14\ub85c\uadf8\ub97c \uacc4\uc18d \uc368\uc57c \ud560\uae4c?\\n\\n\ube14\ub85c\uadf8\uc5d0 \uae00\uc744 \uc548 \uc4f4\uc9c0 3\uac1c\uc6d4 \uac00\ub7c9 \uc9c0\ub0ac\ub2e4.  \\n\ub2e4\uc591\ud55c \uc0dd\uc131\ud615 AI \uc11c\ube44\uc2a4\ub97c \uc811\ud558\uba74\uc11c \ube14\ub85c\uadf8\uc5d0 \ub300\ud55c \uc874\uc7ac\ub860\uc801 \ubb3c\uc74c\uc774 \ub4e4\uc5c8\ub2ec\uae4c?  \\n\ub0b4\uac00 \ud558\ub8e8 \uc911\uc5d0 \uc77d\uac8c \ub418\ub294 \ucee8\ud150\uce20, \uadf8 \uc911\uc5d0\uc11c\ub3c4 \uae30\uc220 \ucee8\ud150\uce20\uc758 \uc0c1\ub2f9\ud55c \ube44\uc911\uc740 \uc0dd\uc131\ud615 AI\ub85c\ubd80\ud130 \ub098\uc628\ub2e4.\\n\uac04\ub2e8\ud55c \ub9ac\ub205\uc2a4 \uba85\ub839\uc5b4\ub098 \uc258\uc2a4\ud06c\ub9bd\ud2b8\ubd80\ud130 \ub124\ud2b8\uc6cc\ud06c \ud328\ud0b7 \ubd84\uc11d\uc774\ub098 \uad00\ub828\ud55c RFC \ucd94\uc801, \ud56b\ud55c \ud2b8\ub79c\ub4dc\uac00 \ub418\uace0 \uc788\ub294 MCP Spec \ubd84\uc11d\uacfc \uad6c\ud604\uae4c\uc9c0 \uc0dd\uc131\ud615 AI \uac00 \ub0b4\ub193\uc740 \\n\\n\\n\uadf8 \uc0ac\uc774 AI \uae30\uc220\uc740 \ud558\ub8e8\uac00 \uba40\ub2e4\ud558\uace0 \uaca9\ubcc0\ud558\ub294 \uc2dc\uae30\ub97c \uac70\uce58 \uace0 \uc788\ub2e4. \uc774\uc81c \ub204\uad6c\ub4e0 \ucf54\ub529 \ubb38\uc81c\uac00 \uc0dd\uae30\uba74 \uad6c\uae00\ub9c1\ubcf4\ub2e4 \ube60\ub974\uac8c ChatGPT\ub098 Claude\uc5d0\uac8c \ubb3c\uc5b4\ubcf4\ub294 \uc2dc\ub300\uac00 \ub410\ub2e4. \uc774\uc81c\ub294 \uac04\ub2e8\ud55c \ub9ac\ub205\uc2a4 \uba85\ub839\uc5b4\ubd80\ud130 \ubcf5\uc7a1\ud55c SQL \ucffc\ub9ac\ubb38, \ucf54\ub4dc \ub9ac\ubdf0\uc640 \ub300\uccb4\uae30\uc220\uae4c\uc9c0 \uc54c\uc544\uc11c \ucc99\ucc99 \uc54c\ub824\uc8fc\ub2c8 \uad73\uc774 \uad6c\uae00\ub9c1\ud574\uac00\uba70 \ubc1c\ud488\uc744 \ud314 \uc774\uc720\uac00 \uc5c6\uc5b4\uc84c\ub2e4.\\n\uc774\ucbe4 \ub418\uba74 \uc2ec\uac01\ud55c \uc874\uc7ac\ub860\uc801 \ud68c\uc758\uac00 \ub4e0\ub2e4. \uc774\ub7f0 \ucd08\uc6d4\uc801 AI \uc2dc\ub300\uc5d0 \uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \uacc4\uc18d \uc368\uc57c \ud560 \uc774\uc720\uac00 \uc788\uc744\uae4c? \uc218\ub9ce\uc740 \uac1c\ubc1c \ube14\ub85c\uadf8\ub4e4 \uc0ac\uc774\uc5d0\uc11c \ub0b4 \uae00\uc774 \uc874\uc7ac \uc758\ubbf8\uac00 \uc788\uc744\uae4c? \ube14\ub85c\uadf8\ub294 \ucc28\uce58\ud558\uace0 \ub2f9\uc7a5 \uac1c\ubc1c\uc790 \ucee4\ub9ac\uc5b4\ub97c \uacc4\uc18d \uc774\uc5b4\uac08 \uc218\ub294 \uc788\uc744\uae4c?\\n\ub2f9\uc7a5 \uc5b4\ub5a4 \uae30\uc220 \uc8fc\uc81c\ub85c \uae00\uc4f0\uae30\ub97c \uc2dc\ucf1c\ub3c4 \ub098\ubcf4\ub2e4 \ud074\ub85c\ub4dc\uac00 \ub354 \ub9ce\uc740 \uc815\ubcf4\ub97c \uc804\ub2ec\ud574\uc8fc\ub294 \uc2dc\ub300\uc5d0"},{"id":"how-to-mute-the-weired-beep-sound","metadata":{"permalink":"/01010011/blog/how-to-mute-the-weired-beep-sound","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-12-15-how-to-mute-the-weired-beep-sound-when-pressing-shortcuts-on-macos/2024-12-15-how-to-mute-the-weired-beep-sound-when-pressing-shortcuts-on-macos.mdx","source":"@site/blog/2024-12-15-how-to-mute-the-weired-beep-sound-when-pressing-shortcuts-on-macos/2024-12-15-how-to-mute-the-weired-beep-sound-when-pressing-shortcuts-on-macos.mdx","title":"macOS\uc5d0\uc11c \ud2b9\uc815 \ub2e8\ucd95\uc5b4\ub97c \ub204\ub97c \ub54c\ub9cc \ub4e4\ub9ac\ub294 beep\uc74c \uc5c6\uc560\uae30","description":"beep","date":"2024-12-15T00:00:00.000Z","tags":[{"inline":true,"label":"warp","permalink":"/01010011/blog/tags/warp"},{"inline":true,"label":"beep","permalink":"/01010011/blog/tags/beep"},{"inline":true,"label":"macOS","permalink":"/01010011/blog/tags/mac-os"}],"readingTime":2.37,"hasTruncateMarker":false,"authors":[{"name":"01010011","title":"Sr. Software Engineer, Engineering Manager","url":"https://01010011.blog","page":{"permalink":"/01010011/blog/authors/bahamoth"},"socials":{"x":"https://x.com/010100111010","github":"https://github.com/bahamoth","linkedin":"https://www.linkedin.com/in/byeongsu-kang-38899b86/","blog":"https://01010011.blog"},"imageURL":"https://gravatar.com/avatar/bb2519f8e198b51fdc396e8a9d5f475e?size=256","key":"bahamoth"}],"frontMatter":{"slug":"how-to-mute-the-weired-beep-sound","title":"macOS\uc5d0\uc11c \ud2b9\uc815 \ub2e8\ucd95\uc5b4\ub97c \ub204\ub97c \ub54c\ub9cc \ub4e4\ub9ac\ub294 beep\uc74c \uc5c6\uc560\uae30","authors":["bahamoth"],"tags":["warp","beep","macOS"]},"unlisted":false,"prevItem":{"title":"should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs","permalink":"/01010011/blog/2025/03/20/should-i-still-write-blogs-in-the-ai-era/should-i-still-write-blogs"},"nextItem":{"title":"\ud638\ub791\uc774\ub294 \uc8fd\uc5b4\uc11c \uac00\uc8fd\uc744 \ub0a8\uae30\uace0 \ud504\ub85c\uadf8\ub7a8\uc740 \uc8fd\uc5b4\uc11c \ub364\ud504\ub97c \ub0a8\uae34\ub2e4.","permalink":"/01010011/blog/how-to-collect-crash-dump"}},"content":"import styles from \'../blog.module.css\';\\n\\n![beep](./beep-sound.png)\\n\\n\ub9e5\ubd81\uc744!! \uc0c0\ub2e4!! (!! m4!! pro!! max!! 64GB!! \ud83c\udf89\ud83c\udf89\ud83c\udf89)\\n\\n\uc0c8 \ub9e5\ubd81\uc5d0 \uc774\uc804 \ub9e5\ubd81 \uc124\uc815\uc744 \ub9c8\uc774\uadf8\ub808\uc774\uc158\ud558\ub294 \ub300\uc2e0 \ucc98\uc74c\ubd80\ud130 \ub9e5\ubd81\uc744 \uc138\ud305\ud558\uae30\ub85c \uacb0\uc815, \uae30\uc874\uc5d0 \uc368\ubcf4\uc9c0 \ubabb\ud588\ub358 \ub3c4\uad6c\ub4e4\ub3c4 \ud558\ub098 \ub458 \uc54c\uc544\uac00\ub294 \uc7ac\ubbf8\ub97c \uc990\uae30\uace0 \uc788\ub2e4.\\n\ud130\ubbf8\ub110 \ud504\ub85c\uadf8\ub7a8\ub3c4 iterm2\uc5d0\uc11c \ub2e4\ub978\uac78 \uc368\ubcf4\ub824\uace0 Warp\ub97c \uc124\uce58\ud588\ub294\ub370 \uc544\uc8fc \ub9cc\uc871\ub3c4\uac00 \ub192\ub2e4.\\n\\n\uadf8\ub7f0\ub370 \ud669\ub2f9\ud55c \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud588\ub2e4. Split pane(Horizontal) \uc758 \ud06c\uae30\ub97c \uc904\uc774\ub824\uace0 `cmd + ctrl + \u2193` \ud0a4\ub97c \ub20c\ub800\ub354\ub2c8,\\n\\n\\"\uc091\\"\\n\\nbeep\uc74c\uc774 \ub4e4\ub9ac\ub294 \uac83\uc774\ub2e4.\\n\\n`cmd + ctrl + \u2193` `cmd + ctrl + \u2193`\\n\\n\\"\uc091\\" \\"\uc091\\"\\n\\n\ud76c\ud55c\ud558\uac8c\ub3c4 `cmd + ctrl + \u2191` \ud0a4\ub97c \ub204\ub97c \ub54c\ub294 \uc544\ubb34 \uc18c\ub9ac\uac00 \ub098\uc9c0 \uc54a\uc558\ub2e4.\\nWarp \ubb50\uc57c. \uc2dc\ub044\ub7fd\uac8c. \ubd84\ud560\ucc3d \ud06c\uae30 \uc870\uc808\uc744 \uc5bc\ub9c8\ub098 \uc790\uc8fc\ud558\ub294\ub370 \uc774\ub7ec\uba74 \uace4\ub780\ud558\uc9c0. \uc548\ud0c0\uae5d\uc9c0\ub9cc \uace7 \ub098\uc62c Ghostty \ub098\uc624\uba74 Warp\ub294 \ud3d0\uae30\ub2e4.\\n\ub77c\uace0 \uc0dd\uac01\ud558\uace0 \ubb34\uc2ec\uacb0\uc5d0 \uac19\uc740 \ub2e8\ucd95\ud0a4(`cmd + ctrl + \u2193`)\ub97c vs code\uc5d0\uc11c \ub20c\ub7ec\ubd24\ub2e4.\\n\\n\\"\uc091\\"\\n\\n\uc5b4\ub77c? vs code\uc5d0\uc11c\ub3c4 beep\uc74c\uc774 \ub098\ub294\ub370? chrome\uc5d0\uc11c\ub3c4?\\n\ud3c9\uc18c\uc5d0 \uc74c\uc18c\uac70 \uc0c1\ud0dc\uc5d0\uc11c \ub9e5\ubd81\uc744 \uc774\uc6a9\ud558\uae30 \ub54c\ubb38\uc5d0 & \uc800 \ub2e8\ucd95\ud0a4\ub97c \ub204\ub97c \uc77c\uc774 \uc5c6\uc5b4\uc11c \uc774\ub7f0 \uac70\uc2ac\ub9ac\ub294 \uc18c\uc74c \ubb38\uc81c\uac00 \uc788\ub2e4\ub294\uac78 \ucc98\uc74c \uc54c\uac8c \ub418\uc5c8\ub2e4.\\n\ucc3e\uc544\ubcf4\ub2c8 \uc774 \ubb38\uc81c\ub294 2019\ub144\ub3c4\ubd80\ud130 Warp \ud130\ubbf8\ub110 \ubfd0 \uc544\ub2c8\ub77c \ub2e4\ub978 \uc571\uc5d0\uc11c\ub3c4 \uc5ec\ub7ec \ucc28\ub840 \ubcf4\uace0\ub41c \uac83\uc73c\ub85c, macOS\uc5d0\uc11c \uc81c\ub300\ub85c \ud0a4\ubc14\uc778\ub529 \ucc98\ub9ac\ub97c \ud558\uc9c0 \ubabb\ud574 \ubc1c\uc0dd\ud558\ub294 \uac83\uc774 \uc6d0\uc778\uc73c\ub85c \ucd94\uc815\ub41c\ub2e4. (\ub9c1\ud06c: https://issues.chromium.org/issues/41432539#comment10)\\n\\n\ud574\uacb0\ubc29\ubc95\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n`~/Library/KeyBindings/DefaultKeyBinding.dict` \ud30c\uc77c\uc744 \uc0dd\uc131\ud558\uace0 \uc544\ub798\uc640 \uac19\uc774 \uc124\uc815, \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc7ac\uc2dc\uc791\ud558\uba74 beep\uc74c\uc774 \uaebc\uc9c4 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n```\\n{\\n    \\"@^\\\\UF701\\" = \\"noop:\\";\\n    \\"@^\\\\UF702\\" = \\"noop:\\";\\n    \\"@^\\\\UF703\\" = \\"noop:\\";\\n}\\n```"},{"id":"how-to-collect-crash-dump","metadata":{"permalink":"/01010011/blog/how-to-collect-crash-dump","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-11-19-how-to-collect-crash-dump/how-to-collect-crash-dump.mdx","source":"@site/blog/2024-11-19-how-to-collect-crash-dump/how-to-collect-crash-dump.mdx","title":"\ud638\ub791\uc774\ub294 \uc8fd\uc5b4\uc11c \uac00\uc8fd\uc744 \ub0a8\uae30\uace0 \ud504\ub85c\uadf8\ub7a8\uc740 \uc8fd\uc5b4\uc11c \ub364\ud504\ub97c \ub0a8\uae34\ub2e4.","description":"tiger","date":"2024-11-19T00:00:00.000Z","tags":[{"inline":true,"label":"crash","permalink":"/01010011/blog/tags/crash"},{"inline":true,"label":"minidump","permalink":"/01010011/blog/tags/minidump"},{"inline":true,"label":"breakpad","permalink":"/01010011/blog/tags/breakpad"},{"inline":true,"label":"crashpad","permalink":"/01010011/blog/tags/crashpad"},{"inline":true,"label":"rust-minidump","permalink":"/01010011/blog/tags/rust-minidump"}],"readingTime":19.255,"hasTruncateMarker":true,"authors":[{"name":"01010011","title":"Sr. Software Engineer, Engineering Manager","url":"https://01010011.blog","page":{"permalink":"/01010011/blog/authors/bahamoth"},"socials":{"x":"https://x.com/010100111010","github":"https://github.com/bahamoth","linkedin":"https://www.linkedin.com/in/byeongsu-kang-38899b86/","blog":"https://01010011.blog"},"imageURL":"https://gravatar.com/avatar/bb2519f8e198b51fdc396e8a9d5f475e?size=256","key":"bahamoth"}],"frontMatter":{"slug":"how-to-collect-crash-dump","title":"\ud638\ub791\uc774\ub294 \uc8fd\uc5b4\uc11c \uac00\uc8fd\uc744 \ub0a8\uae30\uace0 \ud504\ub85c\uadf8\ub7a8\uc740 \uc8fd\uc5b4\uc11c \ub364\ud504\ub97c \ub0a8\uae34\ub2e4.","authors":["bahamoth"],"tags":["crash","minidump","breakpad","crashpad","rust-minidump"]},"unlisted":false,"prevItem":{"title":"macOS\uc5d0\uc11c \ud2b9\uc815 \ub2e8\ucd95\uc5b4\ub97c \ub204\ub97c \ub54c\ub9cc \ub4e4\ub9ac\ub294 beep\uc74c \uc5c6\uc560\uae30","permalink":"/01010011/blog/how-to-mute-the-weired-beep-sound"}},"content":"import styles from \'../blog.module.css\';\\n\\n![tiger](./tiger.png)\\n\\n## \uc11c\ub860\\n\\n\uc544\ubb34\ub9ac \uc18c\ud504\ud2b8\uc6e8\uc5b4\ub97c \uc798 \ub9cc\ub4e4\uc5c8\ub354\ub77c\ub3c4 \uad6c\ub3d9\uc911\uc778 \ud504\ub85c\uadf8\ub7a8\uc774 \uc0ac\uc6a9\uc790 \ud658\uacbd\uc5d0\uc11c \ube44\uc815\uc0c1 \uc885\ub8cc\ub418\ub294 \ubb38\uc81c\ub294 \ud544\uc5f0\uc801\uc774\ub2e4. \\n\\n\uc18d\ub41c \ub9d0\ub85c \'\ud504\ub85c\uadf8\ub7a8\uc774 \uc8fd\ub294\' \ud604\uc0c1\uc774 \uc774\ub7ec\ud55c \ube44\uc815\uc0c1 \uc885\ub8cc\uc5d0 \ud574\ub2f9\ud558\ub294\ub370, \uac1c\ubc1c\uc790 \uc785\uc7a5\uc5d0\uc11c\ub294 \uc65c \uc774\ub7ec\ud55c \'\uc8fd\uc74c\'\uc774 \ubc1c\uc0dd\ud558\ub294\uc9c0 \ud30c\uc545\uc774 \uc5b4\ub835\ub2e4. \uc65c\ub0d0\ud558\uba74 \uac1c\ubc1c\uc790\uc758 PC\uc5d0\uc11c\ub294 \ud504\ub85c\uadf8\ub7a8\uc774 \uc8fd\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc774\ub2e4.([It works on my machine](https://www.amazon.com/works-Machine-Programming-T-Shirt/dp/B07C9FVM4R))  \\n\ub108\ubb34\ub3c4 \ub2e4\uc591\ud55c \uc0ac\uc6a9\uc790 \ud658\uacbd\uc740 \uae30\uc0c1\ucc9c\uc678\ud55c \ubb38\uc81c\ub97c \uc77c\uc73c\ud0a8\ub2e4.([\ubc14\ub2d0\ub77c \uc544\uc774\uc2a4\ud06c\ub9bc \uc54c\ub7ec\uc9c0\uac00 \uc788\ub294 \uc790\ub3d9\ucc28](https://beza1e1.tuxen.de/lore/allergic_car.html)) \\n\\n\uc774\ub7ec\ud55c \uc548\ud0c0\uae4c\uc6b4 \uc8fd\uc74c\uc758 \uc6d0\uc778\uc744 \ubd80\uac80\ud558\uae30 \uc704\ud574, \uac1c\ubc1c\uc790\ub294 \ud504\ub85c\uadf8\ub7a8\uc774 \uc2e4\ud589\ub418\uc5c8\ub358 \uc8fc\ubcc0\ud658\uacbd\uc5d0 \ub300\ud55c \ub2e4\uc591\ud55c \uc815\ubcf4\ub97c \uc218\uc9d1\ud55c\ub2e4. \ud5c8\ub098 \uc544\ubb34\ub9ac \ub2e4\uc591\ud55c \uc8fc\ubcc0 \uc815\ubcf4\ub97c \uc218\uc9d1\ud55c\ub2e4 \ud558\ub354\ub77c\ub3c4 \uc9c1\uc811\uc801\uc778 \uc0ac\uc778\uc740 \uc2dc\uccb4\ub97c \ud655\uc778\ud574\uc57c\ub9cc \ud558\ub4ef, \ud504\ub85c\uadf8\ub7a8\uc774 \ube44\uc815\uc0c1 \uc885\ub8cc\ub41c \uc6d0\uc778\uc740 \ud06c\ub798\uc2dc\uac00 \ubc1c\uc0dd\ud55c \uc2dc\uc810\uc5d0 \uba54\ubaa8\ub9ac\uc5d0 \uc801\uc7ac\ub41c \uc2a4\ub0c5\uc0f7\uc744 \ud655\uc778\ud574\uc57c\ub9cc \ud55c\ub2e4.  \\n\\n\uadf8\ub807\ub2e4. \ud638\ub791\uc774\ub294 \uc8fd\uc5b4\uc11c \uac00\uc8fd\uc744 \ub0a8\uae30\uace0 \ud55c\uc6b0\ub294 \uc8fd\uc5b4\uc11c T\ubcf8 \uc2a4\ud14c\uc774\ud06c\ub97c \ub0a8\uae30\ub4ef, \ud504\ub85c\uadf8\ub7a8\uc740 \uc8fd\uc5b4\uc11c \uba54\ubaa8\ub9ac \ub364\ud504\ub97c \ub0a8\uae34\ub2e4. \uc774 \uae00\uc5d0\uc11c\ub294 \uba54\ubaa8\ub9ac \ub364\ud504\uac00 \ubb34\uc5c7\uc778\uc9c0 \uc54c\uc544\ubcf4\uace0, \ub2e4\uc591\ud55c \uc0ac\uc6a9\uc790 \ud658\uacbd\uc5d0\uc11c \ub364\ud504\ub97c \uc218\uc9d1\ud558\uace0 \ucc98\ub9ac\ud558\uae30 \uc704\ud574 \uc5b4\ub5a4 \uacfc\uc815\ub4e4\uc774 \uc774\ub904\uc9c0\ub294\uc9c0\ub97c \uc54c\uc544\ubcf4\uaca0\ub2e4.  \\n\x3c!-- truncate --\x3e\\n\\n## \ud504\ub85c\uadf8\ub7a8\uc758 \uc0dd\uc560\uc8fc\uae30(\uc815\uc0c1\uc885\ub8cc vs \ube44\uc815\uc0c1\uc885\ub8cc)\\n\ud504\ub85c\uadf8\ub7a8\uc758 \ube44\uc815\uc0c1 \uc885\ub8cc\uac00 \ubb34\uc5c7\uc778\uc9c0 \uc124\uba85\ud558\ub824\uba74 \uc815\uc0c1\uc801\uc73c\ub85c \uc2e4\ud589\ub418\uc5b4 \uc885\ub8cc\ub418\ub294 \uc0c1\ud669\uc774 \uc5b4\ub5a4 \ud750\ub984\uc73c\ub85c \uc9c4\ud589\ub418\ub294\uc9c0 \uc54c\uc544\ub458 \ud544\uc694\uac00 \uc788\ub2e4.\\n\\n\uba3c\uc800 \uc18c\uc2a4\ucf54\ub4dc\uac00 \uc2e4\ud589\uac00\ub2a5\ud55c \ud504\ub85c\uadf8\ub7a8\uc73c\ub85c \ubcc0\ud658\ub418\ub294 \uacfc\uc815\uc744 \uac1c\ub7b5\uc801\uc73c\ub85c \uc0b4\ud3b4\ubcf4\uc790. \ucef4\ud30c\uc77c\ub7ec\ub294 \uc18c\uc2a4\ucf54\ub4dc\ub97c \uc5ed\ud560\uc5d0 \ub530\ub77c \ub2e4\uc591\ud55c \uc911\uac04\ud615\ud0dc(=Object File)\ub85c \ubcc0\ud658\ud55c\ub2e4.  \\n\ub2e4\uc74c\uc740 Linux\uc758 Object File \ud615\uc2dd\uc774\ub2e4. \ub2e4\ub978 \ud50c\ub7ab\ud3fc\uc758 \uacbd\uc6b0 \uba85\uce6d\uc774 \uc880 \ub2e4\ub97c \uc218 \uc788\uc73c\ub098 \uac1c\ub150\uc740 \ud06c\uac8c \ub2e4\ub974\uc9c0 \uc54a\ub2e4.  \\n\\n\\n![elf overview](elf-overview.png \\"ELF Overview\\")\\n*\ucd9c\ucc98: https://cs4157.github.io/www/2024-1/lect/15-elf-intro.html*\\n\\n* **text section:** \ucef4\ud30c\uc77c \ud0c0\uac9f \uba38\uc2e0\uc5d0\uc11c \uc2e4\ud589 \uac00\ub2a5\ud55c \uae30\uacc4\uc5b4 \ucf54\ub4dc\\n* **data section:** \ucd08\uae30\ud654\ub41c \uc804\uc5ed\ubcc0\uc218/static \ubcc0\uc218\\n* **bss section:** \ucd08\uae30\ud654\ub418\uc9c0 \uc54a\uc740 \uc804\uc5ed\ubcc0\uc218\uc758 \uba54\ud0c0\uc815\ubcf4\\n* **\uadf8\ubc16\uc5d0:** \uc77d\uae30 \uc804\uc6a9(rodata)\ub098 \uc2ec\ubcfc\ud14c\uc774\ube14(symtab) relocation \uc815\ubcf4(rel.text/rel.data) \ub4f1\ub4f1\\n\\n\uc774 \uc911\uac04\ud615\ud0dc\uc758 Object file\ub4e4\uc774 \uc2e4\ud589\uac00\ub2a5\ud55c \ud615\ud0dc\uc758 Executable file\ub85c \uacb0\ud569\uc774 \ub418\uc5b4\uc57c \ube44\ub85c\uc18c \ucd5c\uc885\uc801\uc778 \ud504\ub85c\uadf8\ub7a8\uc758 \ud615\ud0dc\uac00 \ub41c\ub2e4.  \\n\\n> Java\ub098 Python, Typescript \uac19\uc740 Managed \ud658\uacbd\uc740 \ub3d9\uc791\ubc29\uc2dd\ub3c4 \ub2e4\ub974\uace0, \uc774 \uae00\uc758 \uba54\uc778 \uc8fc\uc81c\uc778 Crash Dump\ub97c (\uc6ec\ub9cc\ud558\uba74)\ub0a8\uae30\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uc5ec\uae30\uc11c\ub294 \ub2e4\ub8e8\uc9c0 \uc54a\ub294\ub2e4.\\n\\n\ud504\ub85c\uadf8\ub7a8\uc774 \uc2e4\ud589\ub418\uae30 \uc704\ud574\uc11c\ub294 Object file\ub4e4\uc744 \uacb0\ud569 \ud6c4 \uba54\ubaa8\ub9ac\uc5d0 \uc801\uc7ac\ud558\uc5ec\uc57c \ud55c\ub2e4. \uc774 \uacfc\uc815\uc5d0\uc11c \ub9c1\ucee4\ub294 \uc5ec\ub7ec \uc624\ube0c\uc81d\ud2b8 \ud30c\uc77c\uc744 \ud558\ub098\uc758 \uc2e4\ud589 \ud30c\uc77c\ub85c \uacb0\ud569\ud558\uace0, \ub85c\ub354\ub294 \uc774 \uc2e4\ud589 \ud30c\uc77c\uc744 \uba54\ubaa8\ub9ac\uc5d0 \uc801\uc7ac\ud55c\ub2e4. \uc774 \uc2e4\ud589\ud30c\uc77c \ud615\uc2dd\uc740 \ud50c\ub7ab\ud3fc\uc5d0 \ub530\ub77c \ub2e4\ub974\ub2e4.\\n* **Windows:** PE(Portable Executable)\\n* **Linux:** ELF(Executable and Linkable Format)\\n* **macOS:** Mach-O(Mach Object)\\n\\n\ud504\ub85c\uadf8\ub7a8\uc774 \uba54\ubaa8\ub9ac\uc5d0 \uc801\uc7ac\ub418\uc5c8\uc744 \ub54c text / data / bss \uac19\uc740 \uc601\uc5ed\uc758 \ud06c\uae30\ub294 \uace0\uc815\uc801\uc774\ub2e4. \ud55c\ud3b8, \ud504\ub85c\uadf8\ub7a8\uc774 \ub3d9\uc791\ud568\uc5d0 \ub530\ub77c \ub3d9\uc801\uc73c\ub85c \ud06c\uae30\uac00 \ub298\uc5c8\ub2e4 \uc904\uc5c8\ub2e4 \ud558\ub294 \uc601\uc5ed\uc774 \uc788\ub294\ub370, TLS(Thread Local Storage)\uc5d0\uc11c \uc790\ub77c\ub098\ub294 \ucf5c\uc2a4\ud0dd\uc774\ub098 \ud799\uc774 \uadf8\ub7ec\ud55c \uc608\uc774\ub2e4. \ucf5c\uc2a4\ud0dd\uc740 \ud568\uc218 \ud638\ucd9c \uc2dc \uc2a4\ud0dd \ud504\ub808\uc784\uc744 \ucd94\uac00\ud558\uace0, \ud568\uc218 \uc885\ub8cc \uc2dc \uc81c\uac70\ud558\ub294 \uad6c\uc870\ub2e4. \ud799\uc740 \ud504\ub85c\uadf8\ub7a8 \uc2e4\ud589 \uc911 \uba54\ubaa8\ub9ac\ub97c \ud560\ub2f9\ud558\uace0 \ud574\uc81c\ud558\ub294 \uc601\uc5ed\uc774\ub2e4.  \\n\\n\ud504\ub85c\uadf8\ub7a8\uc758 \ud2b9\uc815 \uae30\ub2a5\uc744 \uc0ac\uc6a9\ud558\uae30 \uc704\ud574 \ubc84\ud2bc\uc744 \ub204\ub974\uac70\ub098, \ud654\uba74\uc744 \ud130\uce58\ud558\ub294 \ub4f1\uc758 \ud589\uc704\ub97c \ud558\uba74 \uadf8 \uae30\ub2a5\uc744 \uc218\ud589\ud558\uae30 \uc704\ud574 \uad6c\uc131\ub41c \ud568\uc218\ub4e4\uc774 \ucc28\ub840\ub300\ub85c \ud638\ucd9c\ub41c\ub2e4. \ub54c\ub85c\ub294 \ud06c\uae30\uac00 \uc5bc\ub9c8\ub098 \ub420\uc9c0 \ubaa8\ub974\ub294 \ub370\uc774\ud130\ub97c \uc77d\uace0 \uc4f0\ub294 \uc791\uc5c5\uc774 \ud544\uc694\ud558\uae30\ub3c4 \ud558\ub2e4. \uc774 \uacfc\uc815\uc5d0\uc11c \ucf5c\uc2a4\ud0dd\uacfc \ud799\uc774 \uc790\ub77c\ub098\uac8c \ub41c\ub2e4.  \\n\\n\uc815\uc0c1\uc801\uc778 \uc0ac\uc6a9\uc790 \uc2dc\ub098\ub9ac\uc624\uc5d0\uc11c\ub294 \ud504\ub85c\uadf8\ub7a8\uc774 \ubaa8\ub4e0 \uc791\uc5c5\uc744 \ub9c8\uce58\uace0 \uc885\ub8cc\ub420 \ub54c, \ucf5c\uc2a4\ud0dd\uacfc \ud799\uc5d0 \ud560\ub2f9\ub41c \ubaa8\ub4e0 \uba54\ubaa8\ub9ac\uac00 \uc815\ub9ac\ub418\uace0, \ubaa8\ub4e0 \ub9ac\uc18c\uc2a4\ub294 OS\uc5d0 \ubc18\ud658\ub41c\ub2e4. \uc774\ub85c\uc368 \ud504\ub85c\uadf8\ub7a8\uc740 \uc815\uc0c1 \uc885\ub8cc \uc0c1\ud0dc\uc5d0 \uc9c4\uc785\ud558\uac8c \ub41c\ub2e4.  \\n\\n> `Alt + X` \ub098 `Ctrl + C` \ub85c \ud504\ub85c\uc138\uc2a4\ub97c \uc911\ub2e8\uc2dc\ud0a4\ub294 \uac83\ub3c4 \uc815\uc0c1 \uc885\ub8cc\uc758 \ubc94\uc8fc\uc5d0 \ub4e4\uc5b4\uc57c \ud560\uae4c? \uad00\uc810\uc5d0 \ub530\ub77c \ub2e4\ub974\uaca0\uc9c0\ub9cc \uc77c\ub2e8 \ud544\uc790\uac00 \uae00\uc744 \ud1b5\ud574 \ub2e4\ub8e8\ub824\ub294\uac74 \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc0c1\ud0dc\uc5d0 \uc9c4\uc785\ud55c \ud504\ub85c\uadf8\ub7a8\uc774\ub2e4. `Alt + X` \ub098 `Ctrl + C`\ub85c \ud504\ub85c\uadf8\ub7a8\uc744 \uc885\ub8cc\ud55c\ub2e4\ub294\uac74 \uc0ac\uc6a9\uc790\uc758 \uc758\ub3c4\uc5d0 \uc758\ud574 \ud504\ub85c\uadf8\ub7a8\uc774 \uc885\ub8cc\ub418\ub294 \uac83\uc774\ubbc0\ub85c \uc774 \uae00\uc5d0\uc11c\ub294 \uc815\uc0c1 \uc885\ub8cc\ub85c \uac04\uc8fc\ud55c\ub2e4.\\n\\n\ud558\uc9c0\ub9cc \ud504\ub85c\uadf8\ub7a8\uc774 \uc608\uae30\uce58 \ubabb\ud55c \uc0c1\ud669\uc5d0 \uc9c1\uba74\ud558\uba74 \ube44\uc815\uc0c1 \uc885\ub8cc\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\ub2e4. \uc774\ub294 \ub9c8\uce58 \uc0ac\ub78c\uc774 \uac00\uc11c\ub294 \uc548 \ub418\ub294 \uacf3 - \uad70\uc0ac\ubd84\uacc4\uc120 \ubc14\uae65 \uc9c0\uc5ed\uc774\ub098 \uc740\ud589 \uae08\uace0 \ub4f1 -\uc5d0 \ubc1c\uc744 \ub4e4\uc774\uac70\ub098, \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uce58\uba85\uc801\uc778 \ud53c\ud574\ub97c \uc785\ud788\ub294 \ud589\uc704\ub97c \ud588\uc744 \ub54c \uc815\ubd80\uac00 \uc774\ub97c \uc81c\uc7ac\ud558\uace0 \uac10\uc625\uc73c\ub85c \ubcf4\ub0b4\ub294 \uac83\uacfc \ube44\uc2b7\ud558\ub2e4. \ub9c8\ucc2c\uac00\uc9c0\ub85c OS\ub3c4 \uc2dc\uc2a4\ud15c\uc758 \uc548\uc815\uc131\uc744 \uc704\ud574 \uacc4\uc57d\ub418\uc9c0 \uc54a\uc740 \ud589\uc704\ub97c \ud558\ub294 \ud504\ub85c\uadf8\ub7a8\uc744 \uac15\uc81c\ub85c \uc885\ub8cc\uc2dc\ud0a8\ub2e4. \uc2dc\uc2a4\ud15c \uba54\ubaa8\ub9ac\uc758 \ubcf4\ud638\ub41c \uc601\uc5ed \ub610\ub294 \uc798\ubabb\ub41c \uc8fc\uc18c\ub97c \ucc38\uc870\ud558\uac70\ub098, \ub9ac\uc18c\uc2a4\ub97c \uacfc\ub3c4\ud558\uac8c \uc810\uc720\ud558\ub294 \uacbd\uc6b0 \uc6b4\uc601\uccb4\uc81c\ub294 \ud574\ub2f9 \ud504\ub85c\uadf8\ub7a8\uc744 \uac15\uc81c\ub85c \uc885\ub8cc\ud558\ub294\ub370, \uc774\uac83\uc774 \uc6b0\ub9ac\uac00 \ud754\ud788 \ub9d0\ud558\ub294 \ud06c\ub798\uc2dc\uc774\ub2e4.  \\n\\n## \uc608\uc678\ucc98\ub9ac\\n\uc774\ub7ec\ud55c \uac11\uc791\uc2a4\ub7ec\uc6b4 \ube44\uc815\uc0c1 \uc885\ub8cc\ub97c \uc81c\uc5b4\ud558\uae30 \uc704\ud574 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\uc640 \uc6b4\uc601\uccb4\uc81c\ub294 \uc608\uc678\ucc98\ub9ac \uc218\ub2e8\uc744 \uc81c\uacf5\ud55c\ub2e4. \uc774 \uae00\uc5d0\uc11c\ub294 OS \uc218\uc900\uc758 \uc608\uc678\ucc98\ub9ac\uc5d0 \ub300\ud574\uc11c\ub9cc \ub2e4\ub8ec\ub2e4.  \\n* **Windows:** SEH(Structured Exception Handling)\\n* **Linux:** Signal\\n* **macOS:** Mach Exception & Signal(Mach Exception\uc758 \uc6b0\uc120\uc21c\uc704\uac00 \ub354 \ub192\uc74c)\\n\\n**\ube44\uad50 \ud45c: \ud50c\ub7ab\ud3fc\ubcc4 \uad00\ub9ac \uc608\uc678/\uc2e0\ud638**\\n<div className={styles.table}>\\n| **\ubb38\uc81c \uc720\ud615**       | **Windows (SEH)**           | **Linux (Signals)**     | **macOS (Mach + Signals)**     |\\n|---------------------|-----------------------------|-------------------------|--------------------------------|\\n| **\uc798\ubabb\ub41c \uba54\ubaa8\ub9ac \uc811\uadfc** | STATUS_ACCESS_VIOLATION     | SIGSEGV, SIGBUS         | SIGSEGV, SIGBUS, EXC_BAD_ACCESS|\\n| **\uc2a4\ud0dd \uc624\ubc84\ud50c\ub85c\uc6b0**     | STATUS_STACK_OVERFLOW       | SIGSEGV (\uac04\uc811\uc801\uc73c\ub85c \ubc1c\uc0dd)    | SIGSEGV (\uac04\uc811\uc801\uc73c\ub85c \ubc1c\uc0dd)           |\\n| **\uc798\ubabb\ub41c \uba85\ub839\uc5b4**       | STATUS_ILLEGAL_INSTRUCTION  | SIGILL                  | SIGILL, EXC_BAD_INSTRUCTION    |\\n| **0\uc73c\ub85c \ub098\ub204\uae30 \ub4f1**     | STATUS_FLOAT_DIVIDE_BY_ZERO | SIGFPE                  | SIGFPE, EXC_ARITHMETIC         |\\n| **\ub9ac\uc18c\uc2a4 \ucd08\uacfc**         | STATUS_INSUFFICIENT_RESOURCES| SIGXCPU, SIGXFSZ        | SIGXCPU, SIGXFSZ               |\\n</div>\\n\\n## OS \ubcc4\ub85c \uc11c\ub85c \ub2e4\ub978 \ub364\ud504 \ud3ec\ub9f7\\n\\n \ud06c\ub798\uc2dc\uac00 \ubc1c\uc0dd\ud558\uba74 \uc6b4\uc601\uccb4\uc81c\ub294 \uba54\ubaa8\ub9ac \uc2a4\ub0c5\uc0f7\uc744 \uae30\ub85d\ud558\uc5ec \ub514\ubc84\uae45\uacfc \uc6d0\uc778 \ubd84\uc11d\uc5d0 \ud65c\uc6a9\ud55c\ub2e4. \uadf8\ub7ec\ub098 \uac01 \uc6b4\uc601\uccb4\uc81c\ub294 \ud06c\ub798\uc2dc \uc2dc\uc810\uc758 \uba54\ubaa8\ub9ac \uc0c1\ud0dc\ub97c \uc800\uc7a5\ud558\ub294 \ubc29\uc2dd\uacfc \ud3ec\ub9f7\uc774 \uc11c\ub85c \ub2e4\ub974\ub2e4. \uac01 OS\ub294 \uace0\uc720\uc758 \ub364\ud504 \ud3ec\ub9f7\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud06c\ub798\uc2dc \uc0c1\ud669\uc744 \ubd84\uc11d\ud558\ub294 \ub370 \ud544\uc694\ud55c \uc815\ubcf4\ub97c \uc81c\uacf5\ud55c\ub2e4.  \\n\\n**1. Windows**  \\n  - **Minidump**: Windows \uc6b4\uc601\uccb4\uc81c\ub294 Minidump \ud3ec\ub9f7\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud06c\ub798\uc2dc \uc815\ubcf4\ub97c \uc800\uc7a5\ud55c\ub2e4. Minidump\ub294 \ud06c\ub798\uc2dc \uc6d0\uc778\uc744 \ubd84\uc11d\ud558\ub294 \ub370 \ud544\uc694\ud55c \ucd5c\uc18c\ud55c\uc758 \uc815\ubcf4\ub97c \ud3ec\ud568\ud558\uba70, \ud30c\uc77c \ud06c\uae30\uac00 \uc791\uc544 \uc804\uc1a1\uacfc \ubd84\uc11d\uc774 \uc6a9\uc774\ud558\ub2e4. \ubcf4\ud1b5\uc740 \ud799\uc744 \ud3ec\ud568\ud558\uc9c0 \uc54a\uc73c\uba70, \uc635\uc158\uc73c\ub85c \ud799 \uc601\uc5ed\uc744 \ud3ec\ud568\uc2dc\ud0a4\ub354\ub77c\ub3c4 \uc804\uccb4 \ub0b4\uc6a9\uc744 \ud3ec\ud568\ud558\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \ud30c\uc77c \ud06c\uae30\uac00 \uc0c1\ub300\uc801\uc73c\ub85c \uc791\ub2e4.\\n  - **Full Dump**: \uc804\uccb4 \uba54\ubaa8\ub9ac \ub364\ud504\ub97c \ud3ec\ud568\ud558\uc5ec \ud06c\ub798\uc2dc \uc2dc\uc810\uc758 \ubaa8\ub4e0 \uba54\ubaa8\ub9ac \uc0c1\ud0dc\ub97c \uae30\ub85d\ud55c\ub2e4. \ud799, \uc804\uc5ed\ubcc0\uc218, \ud655\uc7a5 \ub808\uc9c0\uc2a4\ud130, \uae30\ud0c0 \ub9ac\uc18c\uc2a4 \ub4f1\uc758 \ubaa8\ub4e0 \ub0b4\uc6a9\uc744 \ud3ec\ud568\ud558\uc5ec \ud30c\uc77c \ud06c\uae30\uac00 \ud06c\uace0 \ubd84\uc11d\uc774 \ubcf5\uc7a1\ud560 \uc218 \uc788\ub2e4.\\n\\n**2. Linux**\\n  - **Core Dump**: Linux \uc6b4\uc601\uccb4\uc81c\ub294 Core Dump \ud3ec\ub9f7\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud06c\ub798\uc2dc \uc815\ubcf4\ub97c \uc800\uc7a5\ud55c\ub2e4. Core Dump\ub294 \ud504\ub85c\uc138\uc2a4\uc758 \uba54\ubaa8\ub9ac \uc774\ubbf8\uc9c0\uc640 \ub808\uc9c0\uc2a4\ud130 \uc0c1\ud0dc\ub97c \ud3ec\ud568\ud558\uba70, \ub514\ubc84\uae45\uc5d0 \uc720\uc6a9\ud55c \uc815\ubcf4\ub97c \uc81c\uacf5\ud55c\ub2e4. \uadf8\ub7ec\ub098 \ud30c\uc77c \ud06c\uae30\uac00 \ud06c\uace0 \ub2e4\ub8e8\uae30 \uc5b4\ub824\uc6b4 \uacbd\uc6b0\uac00 \ub9ce\ub2e4.\\n\\n**3. macOS**\\n  - **Apple Crash Report**: macOS\ub294 Apple Crash Report \ud3ec\ub9f7\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud06c\ub798\uc2dc \uc815\ubcf4\ub97c \uc800\uc7a5\ud55c\ub2e4. \uc774 \ud3ec\ub9f7\uc740 \ud06c\ub798\uc2dc \uc2dc\uc810\uc758 \uc2a4\ud0dd \ud2b8\ub808\uc774\uc2a4, \uba54\ubaa8\ub9ac \ub0b4\uc6a9, \ub808\uc9c0\uc2a4\ud130 \uc0c1\ud0dc \ub4f1\uc744 \ud3ec\ud568\ud558\uba70, \ubd84\uc11d\uc744 \uc704\ud574 Xcode\uc640 \uac19\uc740 \ub3c4\uad6c\uc640 \ud568\uaed8 \uc0ac\uc6a9\ub41c\ub2e4.\\n\\n**4. Android**\\n  - **Tombstone**: Android \uc6b4\uc601\uccb4\uc81c\ub294 Tombstone \ud3ec\ub9f7\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud06c\ub798\uc2dc \uc815\ubcf4\ub97c \uc800\uc7a5\ud55c\ub2e4. Tombstone\uc740 \ud06c\ub798\uc2dc \uc2dc\uc810\uc758 \uc2a4\ud0dd \ud2b8\ub808\uc774\uc2a4, \uba54\ubaa8\ub9ac \ub0b4\uc6a9, \ub808\uc9c0\uc2a4\ud130 \uc0c1\ud0dc \ub4f1\uc744 \ud3ec\ud568\ud558\uba70, adb\uc640 \uac19\uc740 \ub3c4\uad6c\ub97c \uc0ac\uc6a9\ud558\uc5ec \ubd84\uc11d\ud560 \uc218 \uc788\ub2e4.  \\n    \\n\\n\uc774\ub807\ub4ef \uac01 \uc6b4\uc601\uccb4\uc81c\uc758 \ub364\ud504 \ud3ec\ub9f7\uc740 \ud06c\ub798\uc2dc \uc6d0\uc778 \ubd84\uc11d\uc5d0 \ud544\uc694\ud55c \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uc9c0\ub9cc, \uadf8 \uad6c\uc870\uac00 \ub2e4\ub974\uae30 \ub54c\ubb38\uc5d0 \ud06c\ub85c\uc2a4 \ud50c\ub7ab\ud3fc \ud658\uacbd\uc5d0\uc11c \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \ubc30\ud3ec\ud558\ub294 \uac1c\ubc1c\uc790\ub294 \ud30c\ud3b8\ud654\ub41c \ub364\ud504 \ud3ec\ub9f7\uc744 \uc77c\uc77c\uc774 \uad00\ub9ac\ud574\uc57c \ud55c\ub2e4. \uc774\ub294 \uace0\ud1b5\uc2a4\ub7ec\uc6b4 \uc791\uc5c5\uc774\uae30\uc5d0 \ub364\ud504\ub97c \ub2e4\ub8e8\ub294 \uc77c\uad00\ub41c \ubc29\ubc95\uc774 \ud544\uc694\ud574\uc9c0\ub294 \uc774\uc720\uac00 \ub41c\ub2e4.\\n\\n## Minidump Format \uacfc Chromium Breakpad Project\\n\\n\uc9c0\uae08\uae4c\uc9c0 \uc6b0\ub9ac\uac00 \uc54c\uc544\ubcf8 \uac83\uc744 \uc694\uc57d\ud558\uba74,\\n* \ud504\ub85c\uadf8\ub7a8\uc740 \uc815\uc0c1\uc801\uc73c\ub85c \uc2e4\ud589\ub418\ub2e4\uac00 \uc608\uae30\uce58 \ubabb\ud55c \uc0c1\ud669\uc5d0 \uc9c1\uba74\ud558\uba74 \ube44\uc815\uc0c1 \uc885\ub8cc\ud55c\ub2e4.\\n* \uc6b4\uc601\uccb4\uc81c\ub294 \ube44\uc815\uc0c1 \uc885\ub8cc \uc2dc\uc810\uc758 \uba54\ubaa8\ub9ac \uc2a4\ub0c5\uc0f7\uc744 \uc800\uc7a5\ud558\uc5ec \ub514\ubc84\uae45\uacfc \uc6d0\uc778 \ubd84\uc11d\uc5d0 \ud65c\uc6a9\ud55c\ub2e4.\\n* \uac01 \uc6b4\uc601\uccb4\uc81c\ub294 \ud504\ub85c\uadf8\ub7a8\uc758 \uba54\ubaa8\ub9ac \uc801\uc7ac \ubc29\uc2dd\uc774 \uc11c\ub85c \ub2e4\ub974\uba70, **\ud06c\ub798\uc2dc \ub364\ud504 \ud3ec\ub9f7\ub3c4 \ub2e4\ub974\ub2e4.**\\n* \ub610\ud55c \uac01 \uc6b4\uc601\uccb4\uc81c\ub9c8\ub2e4 **\uc608\uc678\ub97c \ucc98\ub9ac\ud558\ub294 \ubc29\uc2dd\ub3c4 \ub2e4\ub974\ub2e4.**\\n\\n\ube0c\ub77c\uc6b0\uc800\ub098 JVM, .NET \ucc98\ub7fc \ud06c\ub85c\uc2a4 \ud50c\ub7ab\ud3fc \ud658\uacbd\uc5d0\uc11c\ub3c4 \ub3d9\uc77c\ud55c \ubc29\uc2dd\uc758 \ub3d9\uc791\uc744 \ubcf4\uc7a5\ud558\ub294 \ub808\uc774\uc5b4\ub97c \uc9c0\ub2cc \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc740 \uc704\uc640 \uac19\uc740 \ud06c\ub798\uc2dc \ub364\ud504\uc758 \uc218\uc9d1 \ubc0f \ubd84\uc11d \uc2dc \ud30c\ud3b8\ud654 \ubb38\uc81c\uac00 \ud06c\uac8c \uccb4\uac10\ub418\uc9c0 \uc54a\uc744 \uc218 \uc788\ub2e4. \ud5c8\ub098 \uc5ec\ub7ec \ud50c\ub7ab\ud3fc \ud0c0\uac9f\uc744 \uc9c0\uc6d0\ud558\ub294 \ub124\uc774\ud2f0\ube0c \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uacbd\uc6b0, \uc774\ub7ec\ud55c \ud06c\ub798\uc2dc \ud30c\ud3b8\ud654\ub294 \uac1c\ubc1c\uc790\uac00 \ubb38\uc81c\ub97c \ucc3e\uae30 \uc5b4\ub835\uac8c \ud55c\ub2e4.  \\n\\n2008\ub144 9\uc6d4, \uad6c\uae00\uc740 [Chromium\uc774\ub77c\ub294 \uc624\ud508\uc18c\uc2a4 \uc6f9\ube0c\ub77c\uc6b0\uc800 \ud504\ub85c\uc81d\ud2b8\ub97c \ubc1c\ud45c](https://blog.chromium.org/2008/09/welcome-to-chromium_02.html)\ud558\uc600\ub294\ub370, \uc774 \ud504\ub85c\uc81d\ud2b8\uc758 \uc8fc\uc694 \ubaa9\ud45c \uc911 \ud558\ub098\ub294 \ubaa8\ub4e0 \ud50c\ub7ab\ud3fc\uc5d0\uc11c \uc77c\uad00\ub41c \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc744 \uc81c\uacf5\ud558\ub294\ub370 \uc788\uc5c8\ub2e4. \ud544\uc5f0\uc801\uc73c\ub85c \uc5ec\ub7ec \ud50c\ub7ab\ud3fc\uc5d0\uc11c \ubc1c\uc0dd\ud558\ub294 \ud06c\ub798\uc2dc \uc815\ubcf4\ub97c \ud6a8\uacfc\uc801\uc73c\ub85c \uc218\uc9d1\ud558\uace0 \ubd84\uc11d\ud558\uae30 \uc704\ud55c \uc218\ub2e8\uc774 \ud544\uc694\ud588\ub294\ub370, \uc774\ub97c \uc704\ud55c Chromium\uc758 \ud574\uacb0\ucc45\uc774 \ubc14\ub85c [**Breakpad Project**](https://chromium.googlesource.com/breakpad/breakpad/)\uc774\ub2e4.\\n\\nMicrosoft\uc758 Minidump \ud3ec\ub9f7\uc740 Breakpad\uc5d0\uc11c \ud06c\ub85c\uc2a4\ud50c\ub7ab\ud3fc \ud658\uacbd\uc5d0\uc11c \uc77c\uad00\ub41c \ud06c\ub798\uc2dc \ub364\ud504 \uc218\uc9d1\uc744 \uc704\ud574 \ucc44\ud0dd\ud55c \ud615\uc2dd\uc774\ub2e4. [Breakpad Processor \ub514\uc790\uc778 \ubb38\uc11c](https://chromium.googlesource.com/breakpad/breakpad/+/HEAD/docs/processor_design.md)\uc5d0 \ub530\ub974\uba74 \uc65c Minidump \ud3ec\ub9f7\uc744 \uc120\ud0dd\ud558\uc600\ub294\uc9c0\uc5d0 \ub300\ud55c \uc774\uc720\uac00 \uc790\uc138\ud788 \uae30\uc220\ub418\uc5b4 \uc788\ub2e4.\\n* **\uacbd\ub7c9\ud654\ub41c \ud3ec\ub9f7:** Minidump\ub294 \ud06c\ub798\uc2dc \uc6d0\uc778\uc744 \ubd84\uc11d\ud558\ub294 \ub370 \ud544\uc694\ud55c \ucd5c\uc18c\ud55c\uc758 \uc815\ubcf4\ub9cc\uc744 \ud3ec\ud568\ud558\uba70, \ud30c\uc77c \ud06c\uae30\uac00 \uc791\uc544 \uc804\uc1a1\uacfc \ubd84\uc11d\uc774 \uc6a9\uc774\ud558\ub2e4.\\n* **\ud655\uc7a5\uc131:** \ub2e4\uc591\ud55c CPU \uc544\ud0a4\ud14d\ucc98 \ubc0f \uc6b4\uc601\uccb4\uc81c\ub97c \uc9c0\uc6d0\ud558\ub3c4\ub85d \uc124\uacc4\ub418\uc5c8\uc73c\uba70, \ub2e4\ub978 \ud3ec\ub9f7\ub4e4\uacfc\ub294 \ub2e4\ub974\uac8c \ud655\uc7a5\uc774 \uc6a9\uc774\ud558\ub2e4.\\n* **\uac80\uc99d\ub41c \ub3c4\uad6c:** Minidump \ud3ec\ub9f7\uc740 Windows \uc6b4\uc601\uccb4\uc81c\uc5d0\uc11c \uc218 \ub144\uac04 \uac80\uc99d\ub41c \ud3ec\ub9f7\uc774\uae30 \ub54c\ubb38\uc5d0 \uc548\uc815\uc131\uc774 \ub192\uc73c\uba70, MS\uc758 \ub514\ubc84\uae45 \ub3c4\uad6c\ub4e4\uc744 \ud65c\uc6a9\ud560 \uc218 \uc788\ub2e4.  \\n\\n> \ub208\uce58\ube60\ub978 \uc0ac\ub78c\ub4e4\uc740 \uc5ec\uae30\uc11c \uc544\uc9c1 \ud574\uacb0\ub418\uc9c0 \ubabb\ud55c \ud30c\ud3b8\ud654 \ubb38\uc81c\ub97c \uc54c\uc544\ucc4c \uac83\uc774\ub2e4. \ubc14\ub85c Debugging Symbol\uc778\ub370, Minidump\ub97c \uc4f0\ub354\ub77c\ub3c4 \ud50c\ub7ab\ud3fc \ubcc4\ub85c \uc11c\ub85c \ub2e4\ub978 Symbol \ud3ec\ub9f7\uc740 \uc5ec\uc804\ud788 \ubb38\uc81c\uac00 \ub41c\ub2e4.  \\n> \uc774\uc5d0 \ub300\ud55c Breakpad\uc758 \ud574\ubc95\uc740 \uac01 \ud50c\ub7ab\ud3fc\uc758 Symbol\uc744 Breakpad \ub9cc\uc758 Human-Readable\ud55c [\uace0\uc720\uc758 Symbol Format](https://chromium.googlesource.com/breakpad/breakpad/+/HEAD/docs/symbol_files.md)\uc73c\ub85c \ubcc0\ud658\ud558\ub294 \uac83\uc774\ub2e4.\\n\\n<br />\\n\\n\uc544\ub798 \uadf8\ub9bc\uc740 Breakpad \ud504\ub85c\uc81d\ud2b8\uac00 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uc9c0\uc5d0 \ub300\ud55c \uac1c\ub7b5\uc801\uc778 flow\ub97c \ubcf4\uc5ec\uc900\ub2e4.\\n![breakpad flow](breakpad-flow.png)\\n\\n\\n\\n## Breakpad\uc758 \ud55c\uacc4\uc640 \uc774\ub97c \uac1c\uc120\ud558\ub294 \ud504\ub85c\uc81d\ud2b8\ub4e4(Crashpad, Rust-Minidump)\\n![breakpad with caliper](./breakpad-with-caliper.png)\\nBreakpad Client\ub97c \uc0ac\uc6a9\ud574\ubcf4\uba74 \uac00\ub054\uc529 \uc81c\ub300\ub85c \ub41c \ub364\ud504\uac00 \uc218\uc9d1\ub418\uc9c0 \uc54a\ub294 \uacbd\uc6b0\uac00 \uc788\ub2e4. Breakpad Client\uac00 \ub364\ud504\ub97c \uc0dd\uc131\ud560 \ucda9\ubd84\ud55c \uc2dc\uac04\uc744 \ud655\ubcf4\ud558\uc9c0 \ubabb\ud558\uac70\ub098, \ub364\ud504 \uc0dd\uc131 \uc911\uc5d0 \ud504\ub85c\uc138\uc2a4\uac00 \ube44\uc815\uc0c1 \uc885\ub8cc\ub418\ub294 \uacbd\uc6b0\uac00 \uadf8 \uc608\uc774\ub2e4. \uc55e\uc11c \uadf8\ub9bc\uc744 \ubcf4\uba74 Breakpad Client\ub294 \uc0ac\uc6a9\uc790\uc758 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \ud504\ub85c\uc138\uc2a4 \ub0b4\ubd80\uc5d0\uc11c \ub3d9\uc791\ud558\ub3c4\ub85d \uc124\uacc4\ub418\uc5b4 \uc788\ub294\ub370, \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc774 \uc885\ub8cc\ub418\ub294 \uc0c1\ud669\uc5d0\uc11c\ub294 Breakpad Client\uac00 \ub364\ud504\ub97c \uc0dd\uc131\ud560 \ucda9\ubd84\ud55c \uc2dc\uac04\uc744 \ud655\ubcf4\ud558\uc9c0 \ubabb\ud560 \uc218\ub3c4 \uc788\ub2e4.  \\n[Crashpad](https://chromium.googlesource.com/crashpad/crashpad)\ub294 \uc774\ub7ec\ud55c \ud55c\uacc4\ub97c \uadf9\ubcf5\ud558\uae30 \uc704\ud55c \uac1c\uc120 \ud504\ub85c\uc81d\ud2b8\ub85c, \ubcc4\ub3c4\uc758 Crash \uc218\uc9d1 \ubc0f \uc804\uc1a1\uc744 \ub2f4\ub2f9\ud558\ub294 Handler Process\ub97c \uad6c\uc131\ud558\uc5ec \uc774 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uc600\ub2e4.\\n![crashpad overview](crashpad-overview.png)\\n\\n\ud55c\ud3b8, Chromium\uc758 Breakpad\uac00 \uc313\uc544\ub193\uc740 \uc720\uc0b0\uc744 \ud1a0\ub300\ub85c RIIR(Re-write It in Rust)\ud55c [Rust-Minidump](https://github.com/rust-minidump/rust-minidump) \ud504\ub85c\uc81d\ud2b8\ub3c4 \uc8fc\ubaa9\ud560 \ub9cc \ud558\ub2e4. 2017\ub144 luser\ub77c\ub294 \uac1c\ubc1c\uc790\uac00 Rust User Forum\uc5d0 \ucc98\uc74c\uc73c\ub85c \uc18c\uac1c\ud55c \uc774 \ud504\ub85c\uc81d\ud2b8\ub294 Rust \uc5b8\uc5b4\ub85c \uc791\uc131\ud558\uc600\ub2e4\ub294 \uac83 \ub9cc\uc73c\ub85c\ub3c4 \ub2e4\uc591\ud55c \uc7a5\uc810(\uba54\ubaa8\ub9ac \uc548\uc815\uc131, \uc18d\ub3c4, \uc0ac\uc6a9 \ud3b8\uc758\uc131)\uc744 \uac16\uace0 \uc788\uc744 \ubfd0 \uc544\ub2c8\ub77c Rust Crate\uc758 \ud655\uc7a5\uc131\uc744 \ud65c\uc6a9\ud558\uc5ec \uc0ac\uc6a9\uc790\uac00 \uc6d0\ud558\ub294 \uae30\ub2a5\uc744 \uc27d\uac8c \ucd94\uac00\ud560 \uc218\ub3c4 \uc788\ub2e4. \ub364\ud504 \ubd84\uc11d \uacb0\uacfc\ubb3c\uc744 JSON \ud615\ud0dc\ub85c \ucd9c\ub825\ud574\uc8fc\ub294 \ud3b8\uc758 \uae30\ub2a5\uc774\ub098 cli \ub3c4\uad6c\ub3c4 \uc81c\uacf5\ud558\ubbc0\ub85c \ub364\ud504 \ubd84\uc11d\uc744 \uc6d0\ud558\ub294 \uac1c\ubc1c\uc790\ub4e4\uc740 \ub2e4\uc591\ud55c \uc6a9\ub3c4\ub85c \ud65c\uc6a9\uc774 \uac00\ub2a5\ud560 \uac83\uc774\ub2e4.\\n\\n## \uacb0\ub860\\n\uc9c0\uae08\uae4c\uc9c0 \ud06c\ub85c\uc2a4\ud50c\ub7ab\ud3fc \ud658\uacbd\uc5d0\uc11c \ubc1c\uc0dd\ud558\ub294 \ub2e4\uc591\ud55c \ub364\ud504\ub97c \uc218\uc9d1\ud558\uae30 \uc704\ud574 \uc54c\uc544\uc57c \ud558\ub294 \ubc30\uacbd\uc9c0\uc2dd\uacfc, \ud30c\ud3b8\ud654 \ubb38\uc81c\ub97c \ud574\uacb0\ud574\uc8fc\ub294 Breakpad \ud504\ub85c\uc81d\ud2b8\ub97c \uc704\uc2dc\ud55c Crashpad, Rust-Minidump \ub4f1\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc558\ub2e4. \ub300\uac1c\ub294 Sentry\ub098 Google Crashlytics \ub4f1\uc758 Managed Service\ub97c \uc0ac\uc6a9\ud558\ub290\ub77c \uc9c1\uc811 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \ub364\ud504\ub97c \uc218\uc9d1\ud558\uace0 \ubd84\uc11d\ud560 \uc77c\uc774 \ub9ce\uc9c0 \uc54a\uaca0\uc9c0\ub9cc \uc5b4\ub290 \uc815\ub3c4 \uaddc\ubaa8\uac00 \uc788\ub294 \uc11c\ube44\uc2a4\ub97c \uc6b4\uc601, \uc9c1\uc811 \ub364\ud504\ub97c \uc218\uc9d1\ud558\uc5ec\uc57c\ub9cc \ud558\ub294 \uac1c\ubc1c\uc790\uc5d0\uac8c \uc774 \uae00\uc774 \ub3c4\uc6c0\uc774 \ub418\uae38 \ubc14\ub780\ub2e4.\\n> \uad50\uc591\uc73c\ub85c \uc54c\uc544\ub46c\ub3c4 \uad1c\ucc2e\uc9c0 \uc54a\uc744\uae4c?"}]}}')}}]);